(20, 1954, 99, 'lovesolderplymouths', 'Choice of hood', 'This is a nice model, but could have been much better with a painted diecast hood rather than the clear version.  I''d like to see a convertible version of this Dodge.', '208.101.129.2', 1265485241),
(21, 1958, 99, 'lovesolderplymouths', 'Suspension issue', 'I looked forward to adding this one to my garage.  I''m a big fan of dog dish hubcaps and the plain jane sleeper look.  Unfortunately, the particular model I received leans to the right due to a faulty suspension or the chassis not installed properly by M2.', '208.101.129.2', 1265485550),
