(23, 2001, 99, 'lovesolderplymouths', 'Favorite of mine', 'This Dodge Dump is most likely my all-time favorite Matchbox model.  Although I''ve since sold my childhood collection, this one still remains in my collection.', '208.101.129.2', 1265486505),
