(64, 3896, 15, 'patt1289', 'Lots of Milezone tape', 'This was 4 yrs of being overseas.  I put 3/4 of a trailer in storage at my brothers.  I brought out 1 full trailer and have another half to go.  There are plenty of Milezone boxes.  I found a few test run Mustangs, can''t remember if I bought them or you threw them in, very cool finds.  The last few days have been like Christmas (18hrs a day).  My Mustang room is saturated and I''m looking to expand.  I''ll start putting up the pics soon.  Gottat get the garage cleaned first...:-)', '76.125.118.105', 1269525881),
