(73, 5169, 15, 'patt1289', 'Drooling...', '70 Boss or Mach 1 in Calypso Coral.  Number 3 on my all time favorites list.\n1. 64 1/2 with June Manufacture Code \n2. 2011 Boss 5.0 (Hopefully they''ll do it in CC)\n3. In your Pic\n4. 1967 427/400 Vette\n5. Any Mustang Drop Top', '76.125.118.105', 1289708055),
(74, 5169, 417, 'Mach1Guy', ':)', 'Nice list and glad you enjoyed my Mach. Is there a special reason why U want a June dated 64 1/2 Mustang?\nNot sure if I am a fan of the 2011 Boss.....my fingers are crossed for a 13/14 Mach but who knows if that will happen. \n67 Vettes are pretty amazing, my father has a 68 Vert 427. Has had it forever, he wishes he got a 67 but hes lucky to have what he has :)', '67.193.132.221', 1289736513),
