(1175, 258, 12, 'MB #1-C Roadroller', 'Light green and dark green.  Replaced 1B in 1958', '', 1262753469, 1, '1C-67.jpg', '1C-67.jpg', '', 1, 0, 0, 0, '0.00', 98),
(1176, 258, 12, 'MB #1-D Roadroller', 'The 4th and final roadroller casting.   Change to plastic wheels.  Replaced 1C in 1962', '', 1262753469, 1, '1D-129.jpg', '1D-129.jpg', '', 1, 0, 0, 0, '0.00', 102),
(1177, 258, 12, 'MB #1-E- Mercedes Truck', 'The last casting to ever wear the #1 was the 1E Mercedes Truck.  It replaced the 1D roadroller in August of 1967 and was retained over into the Superfast era.', '', 1262753469, 1, '1E-205.jpg', '1E-205.jpg', '', 1, 0, 0, 0, '0.00', 97),
(1178, 258, 12, 'MB #1-E and 2-D- Mercedes truck and trailer', '', '', 1262753469, 1, '1E__2D.jpg', '1E__2D.jpg', '', 1, 0, 0, 0, '0.00', 100),
(1179, 258, 12, 'MB #2-A Muir Hill Site Dumper', 'Introduced to the Matchbox range as one of the first four models in late 1953.  The original models had wheels painted green like the body.  Notice the early type "A" box with the word "MOKO" in script.', '', 1262753469, 1, '2A-2_edited.jpg', '2A-2_edited.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1180, 258, 12, 'MB #2-B Muir Hill Site Dumper', 'both metal and gray plastic wheel variations\nReplaced 2A in 1957', '', 1262753469, 1, '2B-45.jpg', '2B-45.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1181, 258, 12, 'MB #2-C Muir Hill Dumper', 'Replaced the 2B dumper in July 1962', '', 1262753469, 1, '2C-132.jpg', '2C-132.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1182, 258, 12, 'MB #2-D Mercedes trailer', 'Introduced in August 1967 to mate with 1E Mercedes truck', '', 1262753469, 1, '2D-206.jpg', '2D-206.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1183, 258, 12, 'MB #3-A Cement mixer', 'some of the 13 known variations on this 3A cement mixer casting.  Notice both wheel and casting variations here.  Also and early "A" box and the later "B" box with the word "MOKO" in block letters.', '', 1262753469, 1, '3A-3.jpg', '3A-3.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1184, 258, 12, 'MB #3-B Bedford 7.5 ton tipper truck', 'The Bedford tipper truck replaced the #3A cement mixer in July 1961.\nThis model came with either gray or black plastic wheels and either red or maroon dumper bed colors to go with the pale gray cab.', '', 1262753469, 1, '3B-121.jpg', '3B-121.jpg', '', 1, 0, 0, 0, '0.00', 40),
(1185, 258, 12, 'MB #3-C Mercedes Benz Ambulance', 'Models came painted in either cream or off-white body paint with a removable patient on a stretcher that could be accessed through the rear hatch.  This model replaced the #3B Bedford Tipper truck in November of 1967', '', 1262753484, 1, '3C-210.jpg', '3C-210.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1186, 258, 12, 'MB #4-A Massey Harris Tractor', 'Released in 1954\nType A script box', '', 1262753484, 1, '4A-_A_box.jpg', '4A-_A_box.jpg', '', 1, 0, 0, 0, '0.00', 38),
(1187, 258, 12, 'MB #4-A Massey Harris Tractor with Early Lesney Massey Harris Tractor', 'Prior to the introduction of the Matchbox range Lesney Products made a range of larger scale toys that today are known as "Early Lesney Toys".  These toys were larger scale versions of toys that ultimately ended up in the Matchbox range.  This Massey Harris pairing is a good example.', '', 1262753484, 1, '4A_with_early_Lesney.jpg', '4A_with_early_Lesney.jpg', '', 1, 0, 0, 0, '0.00', 43),
(1188, 258, 12, 'MB #4-B Massey Harris Tractor', 'In 1957 Lesney made some subtle differences in the earlier release 4A Massey Harris tractor.  With the 4B the fenders were eliminated from the rear wheels, the front wheels were changed, the driver was attached differently and the later castings were fitted with gray plastic wheels.', '', 1262753484, 1, '4B-46.jpg', '4B-46.jpg', '', 1, 0, 0, 0, '0.00', 39),
(1189, 258, 12, 'MB #4-C Triumph T110 motorcycle & sidecar', 'The handsome Triumph T110 replaced the little Massey Harris 4B in July 1960', '', 1262753484, 1, '4C-102.jpg', '4C-102.jpg', '', 1, 0, 0, 0, '0.00', 41),
(1190, 258, 12, 'MB #4-D Dodge Stake Truck', 'In September of 1966 the 3C Triumph motorcycle & sidecar was replaced by the Dodge Stake Truck.  Early models had blue plastic stakes in the bed while the vast majority of models were fitted with green stake beds.', '', 1262753484, 1, '4D-190.jpg', '4D-190.jpg', '', 1, 0, 0, 1, '10.00', 44),
(1191, 258, 12, 'MB #4-D Dodge Stake truck- stake bed color variations', 'seen here is the normal green stake bed and the elusive earlier blue-green stake bed on the 4D Dodge Stake Bed truck', '', 1262753485, 1, '4D-stake_color_variations.jpg', '4D-stake_color_variations.jpg', '', 1, 0, 0, 0, '0.00', 66),
(1192, 239, 7, 'JL Forever 64 R2 ''69 AMC AMX "White Lightning"', 'pink tire variation\r\n\r\nphoto by\r\nMileZone\r\nhttp://milezone.com', '', 1262822940, 1, 'chase383.jpg', 'chase383.jpg', '', 1, 0, 0, 0, '0.00', 43),
