(1375, 258, 12, 'MB #5-A London Double Decker Bus', 'Over most of the years of the regular wheel Matchbox Toys era (1953-1969) the #5 was found on one of the four different generations of London Double Decker buses.  \nThis, the 5A was the smallest and the original.  It appeared on store shelves early in 1954\nThe original example with the type A script MOKO box is on the left side.', '', 1263444169, 1, '5A-_variations.jpg', '5A-_variations.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1376, 258, 12, 'MB #5-B London Double Decker Bus', 'The 5B bus replaced the 5A in 1957.  The size was 5mm longer and the bus came equipped with either metal or gray plastic wheels.  There were also some variations in the labels that were afixed to the sides of the buses.', '', 1263444169, 1, '5B-30.jpg', '5B-30.jpg', '', 1, 0, 0, 0, '0.00', 28),
(1377, 132, 16, 'GL Country Roads R1 ''65 Dodge D-100', '', '', 1263444169, 1, 'zc1.jpg', 'zc1.jpg', '', 1, 0, 0, 0, '0.00', 64),
(1378, 132, 16, 'GL Country Roads R1 ''08 Custom Dodge Charger', '', '', 1263444169, 1, 'zc2.jpg', 'zc2.jpg', '', 1, 0, 0, 1, '10.00', 85),
(1379, 132, 16, 'GL Country Roads R1 ''67 Dodge D-100 Sweptline', '', '', 1263444169, 1, 'zc3.jpg', 'zc3.jpg', '', 1, 0, 0, 0, '0.00', 79),
(1380, 258, 12, 'MB #5-C London Double Decker Bus', 'The 5C London bus was the third of the series of buses.  It replaced the 5B in 1960 increasing the length and scale once again, this time by 9mm in length.  Wheels were gray or black plastic with assorted labels affixed', '', 1263444169, 1, '5C-107.jpg', '5C-107.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1381, 132, 16, 'GL Country Roads R1 ''70 Plymouth Road Runner', '', '', 1263444169, 1, 'zc4.jpg', 'zc4.jpg', '', 1, 0, 0, 0, '0.00', 54),
(1382, 132, 16, 'GL Country Roads R1 ''65 Custom Chevrolet Chevelle', '', '', 1263444169, 1, 'zc5.jpg', 'zc5.jpg', '', 1, 0, 0, 0, '0.00', 54),
(1383, 258, 12, 'MB #5-D London Double Decker Bus', 'Seen here is the fourth and final version of the classic London Double Decker bus to be badged with this #5.\nThis final version was now a full 70mm long.  All were equipped with black plastic wheels and they appeared with assorted labels affixed', '', 1263444169, 1, '5D-168.jpg', '5D-168.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1384, 132, 16, 'GL Country Roads R1 ''65 Ford Galaxie 500', '', '', 1263444169, 1, 'zc6.jpg', 'zc6.jpg', '', 1, 0, 0, 0, '0.00', 61),
(1385, 258, 12, 'MB #6-A Quarry Truck', 'Early in 1954 a small Quarry Truck was added to the Matchbox range.  All had a bright orange body with a gray tipper and gold trim paint.  This was the first of what would be three assorted Quarry Trucks identified as #6.', '', 1263444187, 1, '6A-6.jpg', '6A-6.jpg', '', 1, 0, 0, 0, '0.00', 49),
(1386, 258, 12, 'MB #6-B Quarry Truck', 'In 1959 the original diminutive 6A quarry truck was replaced by an update that was 8mm longer than the original.  The new model was painted all in yellow with a label on each door.  Rare examples with gray plastic wheels have been reported but the vast majority were equipped with black.', '', 1263444187, 1, '6B-94.jpg', '6B-94.jpg', '', 1, 0, 0, 0, '0.00', 39),
(1387, 258, 12, 'MB #6-C Quarry Truck', 'The third and final quarry truck replaced the second in August of 1963.  The new truck, also painted yellow, was 4mm longer and appeared with several subtle wheel and casting variations.', '', 1263444187, 1, '6C-145.jpg', '6C-145.jpg', '', 1, 0, 0, 0, '0.00', 47),
(1388, 120, 16, 'GL Auction Block R3 ''70 Cutlass W31 Holiday Coupe', '', '', 1263444188, 1, 'za1.jpg', 'za1.jpg', '', 1, 0, 0, 0, '0.00', 87),
(1389, 120, 16, 'GL Auction Block R3 ''06 Dodge Charger SRT8', '', '', 1263444188, 1, 'za2.jpg', 'za2.jpg', '', 1, 1, 0, 0, '0.00', 66),
(1390, 120, 16, 'GL Auction Block R3 ''62 Chevrolet Corvette F1 Convertible 327/360', '', '', 1263444188, 1, 'za3.jpg', 'za3.jpg', '', 1, 1, 0, 0, '0.00', 84),
(1391, 120, 16, 'GL Auction Block R3 ''67 Shelby GT500 Coupe', '', '', 1263444188, 1, 'za4.jpg', 'za4.jpg', '', 1, 1, 0, 0, '0.00', 92),
(1392, 120, 16, 'GL Auction Block R3 ''67 Shelby GT500 Coupe', '', '', 1263444188, 1, 'za5.jpg', 'za5.jpg', '', 1, 0, 0, 0, '0.00', 133),
(1393, 120, 16, 'GL Auction Block R3 ''70 Plymouth Hemi Cuda Coupe', '', '', 1263444188, 1, 'za6.jpg', 'za6.jpg', '', 1, 0, 0, 0, '0.00', 68),
(1394, 258, 12, 'MB #6-D Ford Pick-up', 'Toward the end of the Regular Wheel era that #6C quarry truck was replaced by a bright new red Ford pickup with a white plastic canopy covering the bed.  The models came equipped with either a white plastic or chrome plated grill', '', 1263444188, 1, '6D-224.jpg', '6D-224.jpg', '', 1, 0, 0, 0, '0.00', 56),
(1395, 258, 12, 'MB #7-A Horse Drawn Milk Float', 'The 7A Horse Drawn Milk Float was added to the range in 1954.  Throughout the life of this model all were painted with an orange float/wagon and a brown horse.  It is he trim paint on the horse, driver and milk load that make up some of the most interesting and most collectible variations on this casting.  The common, but better looking wheels were spoked metal type.  The harder to find gray plastic wheels look less authentic.', '', 1263525129, 1, '7A-7.jpg', '7A-7.jpg', '', 1, 0, 0, 0, '0.00', 38),
(1396, 258, 12, 'MB #7-B Ford Anglia', 'Interest in the 7B Ford Anglia casting took a significant uptick thanks to Anglia within the ''Harry Potter and the Chamber of Secrets'' movie.  The model replaced the 7A horse drawn milk float in March of 1961.  Pale blue was the color of this casting throughout its run within the range.  Black and silver plastic wheeled examples are readily avialable.  Gray plastic wheeled examples are much harder to find.', '', 1263525129, 1, '7B-116.jpg', '7B-116.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1397, 258, 12, 'MB #7-C Ford Refuse Truck', 'It was January of 1967 when the 7B Ford Anglia was replaced by the 7C Ford Refuse/garbage truck.  These models appeared with orange cabs, a gray plastic refuse container and a silver painted metal refuse loader.  There were some subtle casting variations across the life of the model.', '', 1263525129, 1, '7C-198.jpg', '7C-198.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1398, 258, 12, 'MB #8-A Caterpillar Tractor', 'It was early in 1955 when the #8A caterpillar tractor appeared within the Matchbox range.  Over the years of the Matchbox regular wheel range there were four casting changes on the #8 Cat tractor.  This, the 8A was the original.  For a short time the rollers were placed prior to application of the yellow paint.  Today those models with yellow rollers and axles are hard to come by.  Later models appeared with a pale yellow, orange with gold trim and finally the ordinary yellow models with silver trim.  Lesney later realized they could make fuller use of the Cat tractors by adding a dozer blade.  All of the #8 tractors later appeared in the line as a #18 bulldozer which was a #8 tractor fitted with a blade.', '', 1263525129, 1, '8A-8.jpg', '8A-8.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1399, 258, 12, 'MB #8-B Caterpillar Tractor', 'It was 1958 when Lesney replaced the original 8A Cat tractor with an updated and slightly larger model.  All of the 8Bs were painted yellow and came equipped with metal rollers.', '', 1263525129, 1, '8B-68.jpg', '8B-68.jpg', '', 1, 0, 0, 0, '0.00', 16),
(1400, 258, 12, 'MB #8-C Caterpillar Tractor', 'In 1961 the third of four Matchbox Cat tractors was added to the range replacing the 8B model.  This model was 6mm longer, was still painted construction yellow but this time added some collecting interest with either metal, black plastic or elusive silver plastic rollers.', '', 1263525129, 1, '8C-124.jpg', '8C-124.jpg', '', 1, 0, 0, 0, '0.00', 16),
(1401, 258, 12, 'MB #8-D Caterpillar Tractor', 'The fourth and final Cat tractor replaced the 8C in 1964.  The final Cat tractor received a style update in addition to enlarged size.  The final Cat tractor also was fabricated with the driver that was cast into each of the model''s fore-runners.  All models appeared with black plastic rollers.', '', 1263525129, 1, '8D-159.jpg', '8D-159.jpg', '', 1, 0, 0, 0, '0.00', 20),
(1402, 258, 12, 'MB #8-E Ford Mustang', 'In November of 1966 Lesney saw fit to bring the long line of #8 Caterpillar tractors to an end, replacing the 8D Cat tractor with the 8E Ford Mustang.  By this time the United States had become by far Lesney''s largest export target.  More and more American cars like the wildly popular new Ford Mustang were folded into the range.  The vast majority of these models appeared iin white but a small handful of models appeared at the close of the regular wheel era with regular wheels but the orange-red paint of the newly introduced Superfast model line.', '', 1263525129, 1, '8E-196.jpg', '8E-196.jpg', '', 1, 0, 0, 0, '0.00', 32),
