(1518, 258, 12, 'MB #13-C Thames Wrecker truck', 'It was 1960 when Lesney saw fit to replace the early and dated Bedford wrecker with still another wrecker, the Thames Trader.  Because the Thames wrecker retained its deep red body color throughout its run in the range it is easy to mistakenly conclude that few changes were made.  Nothing could be further from the truth!  There is a multitude of wheel sizes and colors, variations in the side decals, variations in the hooks and a multitude of variations in the casting itself.  At last count there are more than 25 different variations on how this model escaped the factory.  Seen here is just a few of that 25+', '', 1263786131, 1, '13C-108.jpg', '13C-108.jpg', '', 1, 0, 0, 0, '0.00', 90),
(1519, 258, 12, 'MB #10-A & 10-B Mechanical horse and trailer comparison', 'Seen here are the 1st and 2nd generations of the #10 mechanical horse and trailer.', '', 1263786131, 1, '10A__10B.jpg', '10A__10B.jpg', '', 1, 0, 0, 0, '0.00', 93),
(1520, 258, 12, 'MB #10-A Scammell Mechanical Horse and Trailer', 'Lesney added the 10A Mechanical Horse and trailer to the range in 1955.  For kids in the US market this one was somewhat of a mystery.', '', 1263786131, 1, '10A-10.jpg', '10A-10.jpg', '', 1, 0, 0, 0, '0.00', 88),
(1521, 258, 12, 'MB #10-B Mechanical Horse and trailer', 'In 1957 Lesney upgraded the original 10A Mechanical Horse and trailer as a part of the general trend to increase the size of the toys within the range by a few millimeters.  The new models''s red mechanical horse was mated with a tan colored trailer.  Grill trim could be either silver or gold and wheels on the trailer could be either metal or gray plastic.', '', 1263786131, 1, '10B-47.jpg', '10B-47.jpg', '', 1, 0, 0, 0, '0.00', 86),
(1522, 258, 12, 'MB #10-C Foden Sugar Container truck', 'It was September of 1960 when Lesney replaced the mechanical horse and trailer with a business-like 15-ton Foden Sugar Container Truck in dark blue and Tate & Lyle livery.  This model came with either gray plastic, black plastic and occasionally silver plastic wheels.', '', 1263786131, 1, '10C-104.jpg', '10C-104.jpg', '', 1, 0, 0, 0, '0.00', 98),
(1523, 258, 12, 'MB #10-C Foden Sugar Container Truck with rare rear decal', 'The Tate & Lyle Foden Sugar Container trucks were fited with decals on both the sides and rear of the tank.  An elusive variation features a rear decal with the Tate & Lyle ''crown'' up top.', '', 1263786131, 1, '10C-crown_rear_decal.jpg', '10C-crown_rear_decal.jpg', '', 1, 0, 0, 0, '0.00', 100),
(1524, 258, 12, 'MB #10-D Leyland Pipe Truck', 'The Leyland Pipe Truck replaced the 10C Foden Sugar Container Truck in June of 1966 within the Matchbox range.  The trucks were painted red with blue tinted windows, black plastic wheels and a load of gray plastic pipes on the bed.  Most toys had chrome plated plastic grill and base but some toys missed the plating process and were boxed with unplated white plastic grill and base.  Today the unplated models are highly prized', '', 1263786131, 1, '10D-188.jpg', '10D-188.jpg', '', 1, 0, 0, 0, '0.00', 106),
(1525, 258, 12, 'MB #11-A & 11-B ERF Petrol tanker comparison', 'Here the butterscotch colorred 11A is pictured alongside the later and larger 11B in red.', '', 1263786131, 1, '11A__11B.jpg', '11A__11B.jpg', '', 1, 0, 0, 0, '0.00', 98),
(1526, 258, 12, 'MB #11-A ERF Petrol Tanker', 'In 1955 Lesney added a wonderful ERF cabbed petrol tanker to Matchbox range.  An scant few initial run painted in green escaped the factory only to be replaced by a deep yellow/butterscotch color, then a brigher yellow before finally settling on the red that most models of this casting received.  All  of these models were fitted with metal wheels and the red models were fitted with an oval ''Esso'' decal on the rear of the tanker.', '', 1263786131, 1, '11A-11.jpg', '11A-11.jpg', '', 1, 0, 0, 0, '0.00', 94),
(1527, 258, 12, 'MB #11-B ERF Petrol tanker truck', 'It was 1958 when the diminutive origina 11A ERF Petrol tanker was replaced by a larger brother casting.  All of these models were painted in red and fitted with an oval ''Esso'' decal on the rear of the tank.  There were several subtle casting variations and wheels started as metal, moved to gray plastic and a scant few with either silver or black plastic.  The painted chipped model is treasured in the collection because of the black plastic wheels.', '', 1263786132, 1, '11B-70.jpg', '11B-70.jpg', '', 1, 0, 0, 0, '0.00', 89),
(1528, 258, 12, 'MB #11-C Taylor Jumbo Crane', 'It was June of 1964 when the ERF Petrol tankers were removed from the Matchbox range and replaced ty the 11C Taylor Jumbo Crane.  There are several minor casting variations, variations in the hooks themselves and while early  models were painted all in yellow, the weight box on the later models was painted in red.', '', 1263786132, 1, '11C-154.jpg', '11C-154.jpg', '', 1, 0, 0, 0, '0.00', 86),
(1529, 258, 12, 'MB #11-D Mercedes Benz Scaffolding Truck', 'One of the last castings added to the proud Matchbox regular wheel range was the 11D Mercedes Benz Scaffolding Truck.  All of these trucks were painted silver with green windows, a red plastic grill and base and a wonderfully play-worthy scaffolding pieces out back in the bed of the truck', '', 1263786132, 1, '11D-235.jpg', '11D-235.jpg', '', 1, 1, 0, 0, '0.00', 95),
(1530, 258, 12, 'MB #12-A Land Rover', 'The small 12A Land Rover was added to the Matchbox range in 1955.  The body was green, the driver was tan and the wheels were metal.', '', 1263786132, 1, '12A-12.jpg', '12A-12.jpg', '', 1, 0, 0, 0, '0.00', 109),
(1531, 258, 12, 'MB #12-B Land Rover Series II', 'In 1959 Lesney gave the Land Rover casting an update.  The new 12B casting was larger without the driver found in the oriignal.  Most models were fitted with black plastic wheels but a scant few have been reported with gray plastic wheels.', '', 1263786132, 1, '12B-96.jpg', '12B-96.jpg', '', 1, 0, 0, 0, '0.00', 89),
(1532, 258, 12, 'MB #12-C Land Rover Safari', 'In 1965 the small 12B Land Rover was replaced by a larger Safari style Land Rover with plastic luggage loaded fitted on the roof.  Early models were painted in dark green with later models seeing the blue paint treatment.  At the time of the transition to Superfast models in 1969 some of the regular wheel models were boxed up painted in the metallic gold of the Superfast range.  Those models are difficult to authenticate and very rare.', '', 1263786132, 1, '12C-178.jpg', '12C-178.jpg', '', 1, 0, 0, 0, '0.00', 104),
(1533, 258, 12, 'MB #13-A & B Bedford Wrecker with side by side comparison', 'Only here in a true side view can you see the differnece between these castings.  The later and larger 13B is extended by 3 mm in the rear jib bed which is most noticeable behind the cab of the wrecker.', '', 1263786132, 1, '13A__13B.jpg', '13A__13B.jpg', '', 1, 0, 0, 0, '0.00', 95),
(1534, 258, 12, 'MB #13-A Bedford Wrecker', 'The tiny Bedford Wrecker Truck was added to the Matchbox range in 1955.  the models were painted in light brown with a red tow jib and silver trim.  Wheels were metal', '', 1263786132, 1, '13A-13.jpg', '13A-13.jpg', '', 1, 0, 0, 0, '0.00', 86),
(1535, 258, 12, 'MB #13-B Beford Wrecker', 'Many would ask why Lesney bothered with the 13B model.  It was 1958 when the introduced the new casting that on the surface appears almost identical to the 13A.  Colors are the same and wheels are either metal or a lesser number with gray plastic wheels.  The model is 3 mm longer than the 13A added to the length of the bed out back that houses the tow jib.  (see side-by-side comparison photo)', '', 1263786132, 1, '13B-71.jpg', '13B-71.jpg', '', 1, 0, 0, 0, '0.00', 93),
(1536, 258, 12, 'MB #13-C Thames Wrecker Truck casting variation- side lights', 'Here is an example of a 13C Thames Wrecker with and without the rectangular sidelights beneath the headlamps', '', 1263786132, 1, '13C-front_end_casting_variations.jpg', '13C-front_end_casting_variations.jpg', '', 1, 1, 0, 0, '0.00', 96),
(1537, 258, 12, 'MB #13-C Thames Wrecker Truck casting variations', 'Seen here are one of the ways in which variations occur within this 13C Thames wreciker casting, open or closed lattice on the tow jib', '', 1263786132, 1, '13C-_latice_variations.jpg', '13C-_latice_variations.jpg', '', 1, 0, 0, 0, '0.00', 81),
(1538, 258, 12, 'MB #13-C Thames Wrecker Truck decal variations', 'Some of the decals on the Thames wrecker had letters outlined in black, others did not', '', 1263786132, 1, '13C-decal_variations.jpg', '13C-decal_variations.jpg', '', 1, 0, 0, 0, '0.00', 91),
(1539, 258, 12, 'MB #13-C Thames Wrecker Truck hook variations', 'Hooks on the 13C Thames wrecker truck could be different lengths, of red painted or silver unpainted metal or gray plastic', '', 1263786132, 1, '13C-tow_hook_variations.jpg', '13C-tow_hook_variations.jpg', '', 1, 0, 0, 0, '0.00', 90),
(1540, 258, 12, 'MB #13-C Thames Wrecker Truck wheel variations', 'The wheels on the  13C Thames Wrecker could be black or gray plastic and course or fine treaded with wheel diameters either 11 or 11.5mm.', '', 1263786132, 1, '13C-wheel_variations.jpg', '13C-wheel_variations.jpg', '', 1, 1, 0, 0, '0.00', 136),
(1541, 258, 12, 'MB #13-D Dodge Wrecker Truck', 'It was April of 1965 when Lesney continued on the tradition of a wrecker truck at the #13 slot in the range.  The Dodge Wrecker appeared in the familiar yellow and green of BP petroleum stations.  In the very early days of this model''s run an ultra scant few were created with green cabs and yellow bodies.  The VAST majority were done as you see here with yellow cabs and green bodies.  Most of the side decals/labels had a nicked corner to better fit the casting.  The complete square labels are difficult to find.', '', 1263786132, 1, '13D-166.jpg', '13D-166.jpg', '', 1, 0, 0, 0, '0.00', 98),
(1542, 258, 12, 'MB #9-A and 9-B Dennis Fire Escape Truck comparison', 'Here is a side by side view comparing the 9A Dennis Fire Escape without the front bumper and its replacemenet.', '', 1263786132, 1, '9A__9B.jpg', '9A__9B.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1543, 258, 12, 'MB #9-A Dennis Fire Escape Truck', 'It was 1955 when Lesney added the Dennis Fire Escape Truck to the Matchbox range.  All of these models were released in fire engine red with gold trim paint.', '', 1263786133, 1, '9A-9.jpg', '9A-9.jpg', '', 1, 0, 0, 0, '0.00', 28),
(1544, 258, 12, 'MB #9-B Dennis Fire Escape Truck', 'In 1958 Lesney made some rather subtle changes to the original 9A Dennis Fire Escape Truck.  The main difference was the addition of a front bumper on the casting.  The vast majority of these models had metal wheels.  At the tail end of this run they released a short run of models fitted with gray plastic wheels.', '', 1263786133, 1, '9B-69.jpg', '9B-69.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1545, 258, 12, 'MB #9-C Merryweather Marquis Series III Fire Engine', 'In 1959 Lesney replaced the rather antiquated 9B Dennis Fire Escape truck with a handsome new Merryweather Marquis Series III casting.  Early models were fitted with gray plastic wheels while latter trucks were fitted with black.  There were a number of subtle casting variations across the run of this casting.  The ladders up top came painted in either tan, gold, or silver.', '', 1263786133, 1, '9C-95.jpg', '9C-95.jpg', '', 1, 0, 0, 0, '0.00', 40),
(1546, 258, 12, 'MB #9-D Boat and Trailer', 'In 1966 Lesney ended the tradition of fire trucks filling the #9 slot within the range.  The 9D model was a plastic blue and white cabin cruiser style boat ridding atop a diecast metal trailer painted in deep blue.', '', 1263786133, 1, '9D-197.jpg', '9D-197.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1549, 263, 15, 'MB Pre-Proction Sample', 'Scooby Doo Mustang.  Created for theme parks', '', 1263825537, 1, 'a1b1_1.jpg', 'a1b1_1.jpg', '', 1, 0, 0, 0, '0.00', 74),
(1550, 263, 15, 'MB Toy Show Mustang 1999', 'Mustang Fastback from PA Toy Show in 1999', '', 1263825537, 1, '99_Toy_Show.jpg', '99_Toy_Show.jpg', '', 1, 0, 0, 0, '0.00', 36),
(1551, 244, 15, 'Matchbox Superfast 2004 #47 Ford Mustang GT', 'One of Fifteen Thousand', '', 1263825537, 1, '8fd1_1.jpg', '8fd1_1.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1552, 244, 15, 'Matchbox Superfast 2005 #6 Mustang GT Concept', '1 of 15,500', '', 1263825537, 1, '808f_1.jpg', '808f_1.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1555, 150, 7, 'GL Muscle Car Garage Hobby R3 ''89 Pontiac Trans Am "Green Machine"', 'photo by\r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1263956073, 1, 'chase396.jpg', 'chase396.jpg', '', 1, 0, 0, 1, '10.00', 50),
(1556, 274, 7, 'GL Black Bandit R5 ''72 AMC Javelin AMX "Green Machine"', 'photo by\r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1263956073, 1, 'chase398.jpg', 'chase398.jpg', '', 1, 0, 0, 1, '10.00', 54),
(1558, 258, 12, 'MB #14-A Daimler Ambulance', 'The tiny cream colored Daimler ambulance was added to the Matchbox range in 1955.  Each toy was marked with a red cross decal centered on the roof', '', 1264017683, 1, '14A-14.jpg', '14A-14.jpg', '', 1, 0, 0, 0, '0.00', 80),
(1559, 258, 12, 'MB #14-B Damiler Ambulance', 'It was 1958 when Lesney saw fit to scrap the tiny 14-A Damiler Ambulance and replace it with a model that varied very little from the original other than in scale.  The new model was 4mm longer than the original.  The new model was also fitted with a black base and body colors varied from cream to general off-white.  Wheels were either metal, gray plastic or a few escaped the factory rolling on silver plastic.  The roof was still decorated with a central red cross decal', '', 1264017683, 1, '14B-72.jpg', '14B-72.jpg', '', 1, 0, 0, 0, '0.00', 90),
(1560, 258, 12, 'MB #14-A & 14-B side-by-side comparison', 'This photo provides a sense of scale comparison between the original (1955) 14-A Daimler ambulance and the 14-B replacement (1958)', '', 1264017683, 1, '14A__14B.jpg', '14A__14B.jpg', '', 1, 0, 0, 0, '0.00', 90),
(1561, 258, 12, 'MB #14-C Bedford Lomas Ambulance', 'In May of 1962 Lesney replaced the 14-B Daimler Ambulance with an updated Bedford powered Lomas Ambulance.  These models originally were intended to have a red cross decal on the roof as there had been on the earlier Daimler ambulance models.  In reality very few models ever were fitted with this red cross roof decal.  Those modlels are prized today.  For a period of time the casting continued to have a raised guide line sequence on the roof for alignment of a decal that was never applied.  Today even these models with the roof decal guide lines are prized are hard to find.  Ultimately the casting was modified and these unused guide lines were eliminated.  Models appear in assorted shades of white and off-white with assorted side decals featuring either blue or black lettering.  Wheels can be either black, gray or silver plastic but black is by far the most common.', '', 1264017683, 1, '14C-130.jpg', '14C-130.jpg', '', 1, 0, 0, 0, '0.00', 92),
(1562, 258, 12, 'MB #14-D Iso Grifo', 'It was February of 1968, late in the regular wheel era, when the #14-C Lomas ambulance was replaced with something very un-ambulance-like, the ultra sporty and limited production Italian exotic Iso Grifo.  The models all appeared in a deep metallic blue paint with light blue plastic interior and clear windows.  Strangely the model was fitted with a tow hitch.  Probably not too many people pulling the boat with their Iso Grifo!', '', 1264017683, 1, '14D-212.jpg', '14D-212.jpg', '', 1, 0, 0, 0, '0.00', 89),
(1563, 258, 12, 'MB #15-A Diamond T Prime Mover', 'The small but mighty 15-A Diamond T Prime mover was added to the Matchbox range in 1955.  It is the very first few models painted in lemon yellow that are ultra rare.  The final run of 15-A models were painted in the normal orange body color but were fitted with ten small gray plastic wheels instead of the normal 6 metal wheels.  These gray plastic wheeled toys are highly prized.  The normal models are quite plentiful and one of the more affordable early Matchbox models.', '', 1264032373, 1, '15A-15.jpg', '15A-15.jpg', '', 1, 0, 0, 0, '0.00', 86),
(1564, 258, 12, 'MB #15-A Diamond T Prime Mover fitted with hard to find gray plastic wheels', '', '', 1264032373, 1, '15A-_10_wheel_variation-_rear.jpg', '15A-_10_wheel_variation-_rear.jpg', '', 1, 0, 0, 0, '0.00', 90),
(1565, 258, 12, 'MB #15-A Diamond T Prime Mover with 16-A trailer in tow', 'When the engineers at Lesney introduced the 15-A Prime Mover in 1955 they were beginning to think of play value.  Along with the 15-A they introduced a low-level transport trailer, 16-A.  Kids could roll their 8-A Caterpillar tractor up on the 16-A, lift the loading ramp and hitch the whole works to their 15-A Prime Mover truck!', '', 1264032373, 1, '15A__16A.jpg', '15A__16A.jpg', '', 1, 0, 0, 0, '0.00', 95),
(1566, 258, 12, 'MB #15-B Rotinoff Super Atlantic Tractor', 'In 1959 Lesney replaced the tiny 15-A Diamond T Prime Mover with an upgraded powerful Rotinoff Super Atlantic Tractor.  Like the 15-A the new model was painted in orange.  The vast majority of these models were fitted with black plastic wheels but there were a handful that escaped the factory rolling on gray plastic wheels.  Today those models are highly prized.', '', 1264032373, 1, '15B-97.jpg', '15B-97.jpg', '', 1, 0, 0, 0, '0.00', 108),
(1567, 258, 12, 'MB #15-B Rotinoff Super Atlantic Tractor paired with 16-B transport trailer', 'Just as Lesney prepared a transport trailer to be paired with the 15-A Prime Mover, they also prepared an updated transport trailer to go with the new 15-B Rotinoff Super Atlantic Trailer in 1959', '', 1264032373, 1, '15B__16B.jpg', '15B__16B.jpg', '', 1, 0, 0, 0, '0.00', 79),
(1568, 258, 12, 'MB #15-C Dennis Tippax Refuse Collector truck', 'In was November of 1963 that Lesney replaced the 15-B Rotinoff Super Atlantic tractor with a handsome new Tippax Refuse Collector Truck.  Because this model always featured the same blue and gray paint scheme it is easily overlooked as one of those ''only need one'' models.  The truth is that thanks to wheel variations, decal variation and casting variations this ends up being a challenging model to fully collect.', '', 1264032373, 1, '15C-147.jpg', '15C-147.jpg', '', 1, 0, 0, 0, '0.00', 96),
(1569, 258, 12, 'MB #15-C Dennis Tippax Refuse Collector variations', 'Early models in the 15-C run can be identiifed by their silver grill trim paint and course treaded (24 treads) black plastic wheels.  At the front of the gray refuse container most models feature a tiny peep-hole through the casting which aided with removal of the casting from the die.  The very earliest models did NOT have this tiny peep hole.  These models without the peep hole are the ones that keep collectors looking.', '', 1264032373, 1, '15C-_trim_and_peep_hole_variations.jpg', '15C-_trim_and_peep_hole_variations.jpg', '', 1, 0, 0, 0, '0.00', 101),
(1570, 258, 12, 'MB #15-D Volkswagen 1500 Beetle', 'In November of 1968 the 15-C Tippax Refuse Collector Truck was replaced within the Matchbox range by the 15-D Volkswagen 1500 painted in off-white and decked out in rally race markings.', '', 1264032373, 1, '15D-229.jpg', '15D-229.jpg', '', 1, 0, 0, 0, '0.00', 93),
(1571, 258, 12, 'MB #16-A Transport trailer', 'The transport trailer was released in 1955 along with the 15-A Diamond T Prime Mover', '', 1264032373, 1, '16A-16.jpg', '16A-16.jpg', '', 1, 0, 0, 0, '0.00', 82),
(1572, 258, 12, 'MB #16-B Transport Trailer', 'In 1960 the original 16-A transport trailer was updated to go along with the newly released 15-B Rotinoff Super Atlantic Tractor', '', 1264032373, 1, '16B-109.jpg', '16B-109.jpg', '', 1, 0, 0, 0, '0.00', 81),
(1573, 258, 12, 'MB #16-C Scammell Snow Plow', 'In September of 1963 the 16-B transport trailer was replaced by one of the most easily recognizable castings from the regular wheel Matchbox range, the 16-C Scammell Snow Plow.  Black plastic wheels are more common than gray', '', 1264032390, 1, '16C-146.jpg', '16C-146.jpg', '', 1, 0, 0, 0, '0.00', 49),
(1574, 258, 12, 'MB #16-C Scammell Snow Plow- variations', 'In this profile view you can see the wheel variations as well as the ''open'' and ''closed'' step casting variations', '', 1264032390, 1, '16C-_wheel_and_step_casting_variations.jpg', '16C-_wheel_and_step_casting_variations.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1575, 258, 12, 'MB #16-C Scammell Snow Plow at work', '', '', 1264032390, 1, '16C_at_work.jpg', '16C_at_work.jpg', '', 1, 0, 0, 0, '0.00', 42),
(1576, 258, 12, 'MB #16-D Case Bulldozer tractor', 'In February of 1969 the 16-C Scammell snow plow was replaced by the Case bulldozer.  There are several subtle casting variations', '', 1264032390, 1, '16D-231.jpg', '16D-231.jpg', '', 1, 0, 0, 0, '0.00', 43),
(1577, 258, 12, 'MB #17-A Bedford Removals Van', 'It was 1955 when Lesney added the 17-A Removals Van to the range.  It was powered by the familiar Bedford cab that had been originally introduced on the 13-A wrecker truck.  \nThere were short early runs during which the models were painted in light blue and then later deep maroon but the majority of the models were coated in green.  The maroon models with gold trim paint can be rather difficult to find.  All of these models were fiteed with metal wheels', '', 1264035445, 1, '17A-17.jpg', '17A-17.jpg', '', 1, 0, 0, 0, '0.00', 45),
(1578, 258, 12, 'MB #17-B Bedford Removals Van', 'In 1958 Lesney in a rather subtle fashion updated the 17-A Bedford Removals Van.  The new model on the surface looks identical to the original but the newer models have a flatter dome to the rear van box.  These models were fitted with either metal or gray plastic wheels and the bodies were painted in either a light or dark green.  Some models featured decals in which the letters in the word  "Removals" were outliined in black.', '', 1264035445, 1, '17B-73.jpg', '17B-73.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1579, 258, 12, 'MB #17-C Austin Metropolitan Taxi', 'In August of 1960 Lesney added a model to the range that just oozed of the streets of London, the Austin Metro Taxi.  The lovely casting was painted in deep maroon and fitted with either gray or silver plastic wheels', '', 1264035445, 1, '17C-103.jpg', '17C-103.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1580, 258, 12, 'MB #17-D Foden Hoveringham Tipper truck', 'It was March of 1964 when Lesney eliminated the 17C Austin Taxi from the range and replaced it with a flashy new 8-wheeled Hoveringham tipper truck powered by a Foden cab.  There is a multitude of variations on this one mostly related to suspension differences', '', 1264036462, 1, '17D-150.jpg', '17D-150.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1581, 258, 12, 'MB #17-D Foden Hoveringham Tipper truck- suspension variations', 'some of the Hoveringham tippers were fitted with green or white plastic springs while others had neither.', '', 1264036462, 1, '17D-_suspension_variations.jpg', '17D-_suspension_variations.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1582, 258, 12, 'MB #17-E AEC Horsebox', 'The 17-E Horesebox replaced the Hoveringham tipper within the range in March of 1969.  It was one of the very final few castings added to the regular wheel range before the ''Superfast'' transition.  The truck was powered by AEC, featured a red cab, blue tinted windows, and a dark green plastic horsebox with gray ramp.  Models were equipped with two white plastic horses.  It was me who added the dog just as a shepherd for those loose horses.', '', 1264036462, 1, '17E-232.jpg', '17E-232.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1583, 258, 12, 'MB #18-A Caterpillar Bulldozer', 'The 8-A Caterpillar tractor had been introduced to the range in 1955.  By 1958 the engineers at Lesney realized they could add another toy to the range for with minimal investment by simply adding a bulldozer blade to the 8-A Caterpillar Tractor.  Seen here is a unique 18A that never made it to the axle crimping machine for final finishing of the axle nails.', '', 1264036463, 1, '18A-18.jpg', '18A-18.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1584, 258, 12, 'MB #18-B Caterpillar Bulldozer', 'When Lesney updated the #8 Caterpillar Tractor they also updated the #18 Bulldozer.', '', 1264036463, 1, '18B-74.jpg', '18B-74.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1585, 258, 12, 'MB #18-C Caterpillar Bulldozer', 'When the 3rd generation Caterpillar tractor was introduced the bulldozer too was upgraded in 1961.  One of the few variations on these models is the color of the plastic rollers which could be unpainted metal, silver plastic or black plastic.', '', 1264036463, 1, '18C-125.jpg', '18C-125.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1586, 258, 12, 'MB #18-C Caterpillar Bulldoze- roller color variations', 'seen here are the three roller variations on the 18-C bulldozer; metal, black and silver plastic', '', 1264036463, 1, '18C-roller_variations.jpg', '18C-roller_variations.jpg', '', 1, 0, 0, 0, '0.00', 20),
(1587, 258, 12, 'MB #18-D Caterpillar Bulldozer', 'The 4th generation Caterpillar tractor led to the release in 1964 of the 4th generation Caterpillar bulldozer.  What is missing from earlier versions?  The driver!', '', 1264036667, 1, '18D-160.jpg', '18D-160.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1588, 258, 12, 'MB #18-E Field Car', 'It was March of 1969, the tail end of the regular wheel line, when Lesney ended the tradition of #18 being a bulldozer within the range.  The 18-E Field Car was a somewhat odd addition that closely resembled the American International Scout but really didn''t exactly match any vehicle.  It was an early generic casting.  One of these models features painted highlights done by a railroad toy collector who used it in a train layout', '', 1264042375, 1, '18E-233.jpg', '18E-233.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1589, 258, 12, 'MB #19-A MGTD', 'The wonderful 19-A MGTD roadster was one of the early releases in 1956.  The models appeared in crea and off white body paint with red seats and a tan driver.  All of these models featured metal wheels', '', 1264042375, 1, '19A-19.jpg', '19A-19.jpg', '', 1, 0, 0, 0, '0.00', 38),
(1590, 258, 12, 'MB #19-B MGA roadster', 'In 1958 Lesney replaced the original MGTD roadster with a more modern MGA casting.  Models were fitted with metal, gray plastic or silver plastic wheels.', '', 1264042375, 1, '19B-75.jpg', '19B-75.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1591, 258, 12, 'MB #19-C Aston Martin DBR-5 racer', 'In February of 1962 Lesney replaced the MGA roadster with a wonderful metallic green Aston Martin open-wheeled DB-5 racer.  The drivers were either gray or white plastic.  Most models were fitted with round #19 decals to match the casting 19 in the range.  Others however were fitted with decals from other models in the range when they ran low on #19 decals.  See here is a model with the #52 decals from the #52 Maserati racer.', '', 1264042375, 1, '19C-127.jpg', '19C-127.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1592, 258, 12, 'MB #19-D Lotus Mk33 Coventry Climax Forumula 1 racer', 'In July of 1965 the 19-C Aston Martin racer was replaced by an updated rear-engine open wheeled racer, the British racing green Lotus Mk33 Coventry Climax made famous through racer Jimmy Clark''s exploits.\nThe orange model came later in a Matchbox Gift Race Set and is somewhat harder to find', '', 1264042375, 1, '19D-170.jpg', '19D-170.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1593, 258, 12, 'MB #20-A ERF Stake Lorry/truck', 'The cute little #20-A ERF stake truck was added to the range in 1956.  There are reports of a few of these models being painted in the early days in light green but the vast majority featured the deep maroon or finally dark red seen here.  Models with gold trim are rare and quite handsome.  Wheels were mostly metal but some were fitted with gray plastic', '', 1264042375, 1, '20A-20.jpg', '20A-20.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1594, 258, 12, 'MB #20-B ERF 68G EverReady Battery truck', 'The 20-B ERF EverReady Battery truck replaced the original 20-A ERF Stake truck in 1959.  Wheels can be found in black, gray or silver plastic.', '', 1264042375, 1, '20B-98.jpg', '20B-98.jpg', '', 1, 0, 0, 0, '0.00', 22),
(1595, 258, 12, 'MB #20-C Chevrolet Impala Taxi', 'It was April 1965 when the 20-B EverReady truck was replaced by the 20-C Impala Taxi.  Body color is typically a yellow-orange but a short run of brighter lemon-yellow models came out at the end of this model''s run.  The interior was either red or whilte plastic.  The majority of these model had black plastic plastic wheels but this model made news a few years back when one of the rare gray plastic wheeled examples sold for $7000.00!!!  No kidding!!', '', 1264042375, 1, '20C-165.jpg', '20C-165.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1596, 258, 12, 'MB #21-A & 21-B Bedford Duple Luxury Coach- side by side comparison', 'The original 21A Bedford Luxury Coach was replaced and enlarged in 1958 with the 21-B coach', '', 1264042375, 1, '21A__21B.jpg', '21A__21B.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1597, 258, 12, 'MB #21-A Bedford Duple Luxury Coach/Bus', 'Earlier in the range Lesney had introduced an urban bus, the famous London double decker in the #5 slot.  In 1956 an over the road luxury coach, the Bedford Duple Luxury Coach was added in the #21 slot.  These models had a green body paint, metal wheels and side decals promoting the London to Glasgow line.', '', 1264042375, 1, '21A-21.jpg', '21A-21.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1598, 258, 12, 'MB #21-B Bedford Duple Luxury Coach', 'In 1958  the original green Luxury coach was replaced by an upsided model of the same type and design.  The new casting rolled on either metal or gray plastic wheels and came in either green or dark green body paint.  The "London to Glasgow" decals were still featured on the sides.', '', 1264042375, 1, '21B-76.jpg', '21B-76.jpg', '', 1, 0, 0, 0, '0.00', 32),
