(1643, 258, 12, 'MB #21-C Commer Milk float- base variations', 'Bases on the Commer Milk Float were retained two different ways', '', 1264045555, 1, '21C-base_retention_variations.jpg', '21C-base_retention_variations.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1644, 258, 12, 'MB #21-C Commer Milk float- decal and front base tab variations', 'From this front view you can see the different roof sign decals.  Two of the models show the tiny black base tab showing through the front from the base.  The other model has base rivets.', '', 1264045556, 1, '21C-front_end_variations.jpg', '21C-front_end_variations.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1645, 258, 12, 'MB #21-C Commer Milk float- side variations', 'Seen from this side view you can see different decals, wheels and colors of the milk load in the back', '', 1264045556, 1, '21C-variations.jpg', '21C-variations.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1646, 258, 12, 'MB #21-D Foden Concrete Truck', 'In May of 1968 the Commer Milk Float was replaced with the 21-D Foden Concrete Truck.  Teh cabs were painted in yellow with a red base and chassis and a yellow plastic concrete mixing barrel.  The models had a feature fixed into the base that allowed the barrel to rotate as the truck was pushed along the floor.', '', 1264045556, 1, '21D-218.jpg', '21D-218.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1647, 258, 12, 'MB #21-C Commer Dairy/Milk Float', 'In July of 1961 Lesney replaced the Bedford Luxury coach/bus with a wonderful new Commer Dairy/Milk Float.  This casting has become one of the favorites among vintage Matchbox Toys collectors because of the multitude of ways in which variations are possible.  The base retention, the wheels, the color of the milk load, the decals and windows all offer variation possibilities.', '', 1264045556, 1, '21C-120.jpg', '21C-120.jpg', '', 1, 0, 0, 0, '0.00', 25);
