(1648, 258, 12, 'MB #22-A Vauxhall Cresta', 'It was 1956 when Lesney added the two-toned Vauxhall Cresta to the line.  With it''s maroon body and white roof this scheme was a rather labor intensive experiment for Lesney in those early days.  All of these models had metal wheels.', '', 1264129330, 1, '22A-22.jpg', '22A-22.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1649, 258, 12, 'MB #22-A Vauxhall Cresta pulling the 23-A Berkley Cavalier trailer', 'When the 22-A Vauxhall Cresta was added to the range in 1956 engineers included a towing hitch with the anticipation of the addition of toys to be towed.  Indeed the very next model added to the range was the 23-A Berkley Cavalier travel trailer.', '', 1264129330, 1, '22A_with_23A.jpg', '22A_with_23A.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1650, 258, 12, 'MB #22-B Vauxhall Cresta', 'After a short two year run in the Matchbox range the small 22-A Vauxhall Cresta was updated to reflect the body change of the real Vauxhall Cresta.  Little did Lesny know in 1958 that they were starting a string of model variations that would haunt vintage Matchbox collectors into the 21st century!  Over the seven years this model appeared in the range it featured eight different body paint schemes, with three colors of plastic wheels of three different tread configurations, with and without window inserts.  All told there are surely more than 30 different patterns in which this one model could be collected.  Good luck!  Pristine models go for rather inflated prices.', '', 1264129330, 1, '22B-77.jpg', '22B-77.jpg', '', 1, 0, 0, 0, '0.00', 43),
(1651, 258, 12, 'MB #22-C Pontiac Grand Prix coupe', 'In June of 1965 the popular 22-B Vauxhall Cresta ended a long run in the Matchbox range when the 22-C Pontiac Grand Prix was introduced in a flashy red.', '', 1264129330, 1, '22C-169.jpg', '22C-169.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1652, 258, 12, 'MB #23-A Berkeley Cavalier Travel Trailer/Caravan', 'In 1956 Lesney continued their efforts to provide toys that would enhance play value.  The 22-A Vauxhall Cresta had been introduced with a tow hitch and the very next model was a travel trailer to press that hitch into service.  Across the short run of the 23-A trailer all models were sent out with this pale blue paint.', '', 1264129330, 1, '23A-23.jpg', '23A-23.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1653, 258, 12, 'MB #23-B Berkeley Cavalier Travel Trailer/Caravan', 'After just one year the 23-A travel trailer received some very subtle upgrades.  The casting lines were made more prominent on the new 23-B trailer.  The model was fitted with either metal or gray plastic wheels and either blue or lime-green paint.  A very elusive few were painted in a metallic lime-green at the tail end of thisi model''s run.', '', 1264129330, 1, '23B-48.jpg', '23B-48.jpg', '', 1, 0, 0, 0, '0.00', 20),
(1654, 258, 12, 'MB #23-C Bluebird Dauphine travel trailer/caravan', 'In 1960 the old Berkeley Cavalier travel trailer was upgraded to the Bluebird Dauphine.  A small handful of models were sprayed in the metallic lime-green that had been featured on the previous 23-B Berkeley Cavalier.  The vast majority however were sent out in metallic mauve.  Wheels were commonly gray or silver plastic, uncommonly black plastic.', '', 1264129330, 1, '23C-113.jpg', '23C-113.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1655, 258, 12, 'MB #23-D Travel trailer', 'In February of 1965 Lesney kept the theme alive by replacing the Bluebird Dauphine Travel trailer with the fourth and final travel trailer to be featured in the #23 slot within the range.  Early models appeared in a lemon yellow paint and later models were featured in a pink paint.', '', 1264129330, 1, '23D-164.jpg', '23D-164.jpg', '', 1, 0, 0, 0, '0.00', 31),
