(1708, 258, 12, 'MB #24-A Weatherill Hydraulic Excavator', 'In 1956 Lesney went back to the construction site with the introduction of the 24-A Weatherill Hydraulic Excavator.  The body colors rangedf from yellow to orange-yellow and wheels were metal.', '', 1264216272, 1, '24A-24.jpg', '24A-24.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1709, 258, 12, 'MB #24-B Weatherill Hydraulic Excavator', 'In 1959 Lesney upgraded the original Weatherill Excavator.  The new model was up-sized, featured yellow paint and either gray or black plastic wheels.', '', 1264216272, 1, '24B-99.jpg', '24B-99.jpg', '', 1, 0, 0, 0, '0.00', 18),
(1710, 258, 12, 'MB #24-A & 24-B Weatherill Hydraulic Excavator- side by side comparison', '24-A introduced 1956\n24-B replaces 14-A- 1959', '', 1264216272, 1, '24A__24B.jpg', '24A__24B.jpg', '', 1, 0, 0, 0, '0.00', 20),
(1711, 258, 12, 'MB #24-C Rolls Royce Silver Shadow', 'After a long eight year run Lesney pulled the 24-B Weatherill Hydraulic Excavator from the range and replaced it with something rather unlike it''s predecessor, the handsome and regal 24-C Rolls Royce Silver Shadow in rich mettalic red', '', 1264216272, 1, '24C-201.jpg', '24C-201.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1712, 258, 12, 'MB #25-A Bedford ''Dunlop'' Van', 'In 1956 Lesney added a wonderful Bedford delivery van to the range painted in deep blue and sporting a ''Dunlop'' nameplate.  These models sported either metal, gray plastic or black plastic wheels', '', 1264216273, 1, '25A-25.jpg', '25A-25.jpg', '', 1, 0, 0, 0, '0.00', 19),
