(1729, 258, 12, 'MB #25-B Volkswagen 1200', 'In October of 1960 Lesney set aside the 25-A Dunlop van and replaced it with a wonderful little Volkswagen 1200 with a lifting engine cover in the rear.  These models were painted in a steel blue and sported either gray or silver plastic wheels.', '', 1264217403, 1, '25B-106.jpg', '25B-106.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1730, 258, 12, 'MB #25-C Bedford Petrol Tanker', 'In May of 1964 Lesney replaced the little 25-B VW beetle with a new 25-C Bedford Tanker truck.  The vast majority of these models were painted in the yellow, white and green colors of the BP Petroleum company.  The cab tilted to expose the interior and also the engine.  A very small run of models appeared at the start with gray plastic wheels.  Those models today are highly prized.  Most models rolled on black plastic.  Late in the run the German petroleum company ''Aral'' contracted with Lesney to make a blue cab/chassis variation on this model with "Aral'' labels.  These models, while fairly common in Germany, are at a real premium in the US (see separate photo of Aral version)', '', 1264217403, 1, '25C-152.jpg', '25C-152.jpg', '', 1, 0, 0, 0, '0.00', 28),
(1731, 258, 12, 'MB #25-C Bedford Petrol Tanker- blue ''Aral'' variation', 'Seen here is the elusive ''Aral'' variation on the 25-C Bedford tanker made for the German market.', '', 1264217403, 1, '25C-152_Aral.jpg', '25C-152_Aral.jpg', '', 1, 0, 0, 0, '0.00', 18),
(1732, 258, 12, 'MB #25-D Ford Cortina Mk II', 'In May of 1968 the 25-C Bedford Tanker was replaced by a European Ford Cortina.  The models were painted in a metallic brown with a cream color interior and clear windows.  Models from the G4 Race n'' Rally Gift Set came equipped with a yellow plastic roof rack filled with rally race equipment.', '', 1264217772, 1, '25D-219.jpg', '25D-219.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1733, 258, 12, 'MB #26-A ERF Cement Mixer Truck', 'In 1956 Lesney added the 26-A ERF Cement Mixer to the range.  These models were painted in orange and rolled on either metal, gray plastic, even a few on silver plastic wheels.', '', 1264273907, 1, '26A-26.jpg', '26A-26.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1734, 258, 12, 'MB #26-B Foden Cement Mixer Truck', 'In August of 1961 the original tiny ERF Cement Mixer was replaced within the range by a larger and updated Foden powered Cement truck.  Like the original ERF truck this one was painted in orange with a plastic barrel.  An elusive few have gray barrels but the vast majority have body colored orange barrels.  Wheels are either gray or black plastic.', '', 1264273907, 1, '26B-122.jpg', '26B-122.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1735, 258, 12, 'MB #26-C G.M.C. Tipper Truck', 'In March of 1968 the Foden Concrete truck was replaced by this 26-C GMC Tipper Truck with a red cab, green windows and a silver tipper.', '', 1264273907, 1, '26C-215.jpg', '26C-215.jpg', '', 1, 0, 0, 0, '0.00', 19),
(1736, 258, 12, 'MB #27-A & 27-B Bedford low loader size comparison', '27-A introduced 1956\n27-B replaced 27-A in 1958', '', 1264273907, 1, '27A__27B.jpg', '27A__27B.jpg', '', 1, 0, 0, 0, '0.00', 17),
(1737, 258, 12, 'MB #27-A Bedford Low-loader truck', 'In 1956 Lesney added a small Bedford Low-loader truck to the range to help haul around some of the earlier construction pieces in the range.  The very first few models were painted with a pale blue cab and deep blue trailer (see separate photo) and these models today are highly prized.  The vast majority of the models had light green cabs and tan trailers.  All 27-As roll on metal wheels.', '', 1264273907, 1, '27A-27.jpg', '27A-27.jpg', '', 1, 0, 0, 0, '0.00', 17),
(1738, 258, 12, 'MB #27-A Bedford Low-loader truck- in rare two-tone blue', 'Here is the highly elusive early 27-A Bedford low loader in blue/blue paint scheme.', '', 1264273907, 1, '27A-27-_blue_two-tone.jpg', '27A-27-_blue_two-tone.jpg', '', 1, 0, 0, 0, '0.00', 19),
(1739, 258, 12, 'MB #27-B Bedford Low loader', 'In 1958 Lesney slightly increased the size (17 mm longer) on the Bedford Low loader.  Colors remained green cab and tan trailers.  A few cabs were painted in a deeper/darker green.  Wheels can be gray plastic or metal', '', 1264273907, 1, '27B-78.jpg', '27B-78.jpg', '', 1, 0, 0, 0, '0.00', 16),
(1740, 258, 12, 'MB #27-C Cadillac Sixty Special', 'In July of 1960 Lesney eliminated the Bedford low-loader from the range in favor of a new casting that had special appeal to the American market, the 27-C Cadillac Sixty Special.  The early metallic green models are quite elusive but the later metallic lilac and silver-gray models are more readily available.  Top colors range from white to pink.  Early models had a crimson color base while the final run had a black base.  Wheels can be black, gray or silver plastic', '', 1264273907, 1, '27C-101.jpg', '27C-101.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1741, 258, 12, 'MB #27-C Cadillac Sixty Special - base color variations', 'Seen here are the crimson and black bases of the 27-C Cadillac', '', 1264273907, 1, '27C-base_colors.jpg', '27C-base_colors.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1742, 258, 12, 'MB #27-D Mercedes Benz 230SL', 'In March of 1966 the Mercedes Benz 230SL replaced the 27-C Cadillac within the regular wheel range.  Body color was off-white with a red interior and a clear windscreen.', '', 1264273908, 1, '27D-185.jpg', '27D-185.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1743, 258, 12, 'MB #28-A Bedford Compressor Truck', 'Lesney went to the Bedford truck cab once again in introducing a yellow to orange-yellow compressor truck to the range in 1956.  Wheels were metal on this one.', '', 1264273908, 1, '28A-28.jpg', '28A-28.jpg', '', 1, 0, 0, 0, '0.00', 24),
