(1839, 258, 12, 'MB #28-B Thames Compressor Truck', 'In 1959 Lesney replaced the original Bedford Compressor Truck with a new up-sized and updated compressor truck that shared the new Thames cab seen in the 13-C wrecker truck.  All of these yellow models roll on black plastic wheels.', '', 1264381237, 1, '28B-100.jpg', '28B-100.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1840, 258, 12, 'MB #28-C Jaguar MK 10', 'In May of 1964 Lesney replaced the Thames compressor truck with a handsome new Jaguar MK 10 sedan.  These models were painted a light metallic brown, with clear windows, cream interior and black plastic wheels', '', 1264381237, 1, '28C-153.jpg', '28C-153.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1841, 258, 12, 'MB #28-D Mack Dump Truck', 'In August of 1968 Lesney replaced the Jaguar MK 10 sedan with a distinctly American construction vehicle, the Mack Dump Truck.  These trucks were orange in color with green windows and black tires around either red or yellow wheels', '', 1264381237, 1, '28D-222.jpg', '28D-222.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1842, 258, 12, 'MB #29-A Bedford Milk Delivery van', 'In 1956 Lesney added a pale brown milk van based on the same Bedford platform that they had introduced with the #25-A ''Dunlop'' van.  These models rolled on either metal or gray plastic wheels.', '', 1264387328, 1, '29A-31.jpg', '29A-31.jpg', '', 1, 0, 0, 0, '0.00', 43),
(1843, 258, 12, 'MB #29-B Austin A55 Cambridge', 'In April of 1961 Lesney added another two-tone model to the range in the Austin Cambridge.  The two-tone green body was accented with green plastic windows and either gray, silver, or black plastic wheels.', '', 1264387328, 1, '29B-118.jpg', '29B-118.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1844, 258, 12, 'MB #29-C Le France Fire Pumper', 'In 1966 Lesney replaced the 29-B Austin Cambridge with a Le France Fire Pumper with red body, blue windows and dome light, white plastic hoses and ladders, and black plastic wheels.  Many of these models were identified as part of the ''Denver'' fire fleet with decals on  the doors.', '', 1264387328, 1, '29C-179.jpg', '29C-179.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1845, 258, 12, 'MB #30-A Ford Prefect', 'In 1956 Lesney added a tiny British Ford, the Prefect to the Matchbox range.  Bodies were painted in a light gray-brown and they rolled on either metal or gray plastic wheels.  At the tail end of this models range a short run of Prefect models painted in pale blue left the factory.  These models are highly prized among collectors today.', '', 1264387328, 1, '30A-32.jpg', '30A-32.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1846, 258, 12, 'MB #30-B Magirus-Deutz Crane truck', 'It was March of 1961 when Lesney replaced the tiny 30-A Ford Prefect with a new German Magirus-Deutz Crane truck.  A scant few of these models escaped the factory in a tan body paint with either a red or orange crane boom.  These first few models have been known to sell in mint condition for several thousand dollars apiece!  The vast, vast majority of these models left the factory in silver paint with an orange crane boom/jib.  In addition to the body paint color variations there are also several wheel and hook types that were featured on this casting.  In all there are at least 25 variations on this one model.  Of this bunch the model with an orange hook and gray plastic wheels is the peach!', '', 1264387329, 1, '30B-117.jpg', '30B-117.jpg', '', 1, 0, 0, 0, '0.00', 22),
(1847, 258, 12, 'MB #30-C Faun 8-wheel crane', 'It was August of 1965 when Lesney replaced the 30-B Magirus-Deutz crane truck with a new 8-wheeled Faun crane truck in deep-green paint with an orange crane boom.  The last few of these models were painted in a lighter turquoise or mint green.  These lighter color models are very rare and sell at a considerable premium.', '', 1264387329, 1, '30C-172.jpg', '30C-172.jpg', '', 1, 0, 0, 0, '0.00', 24),
