(1911, 258, 12, 'MB #31-A Ford Station Wagon', 'It was during 1956 that the design team at Lesney made the decision to introduce a car into the range in recognition of the growing sales of Matchbox toys across the ocean in America.  In an effort to add additional American appeal Lesney added a bright yellow American Ford Station Wagon.  The model came with either metal or gray plastic wheels.', '', 1264472218, 1, '31A-33.jpg', '31A-33.jpg', '', 1, 0, 0, 0, '0.00', 36),
(1912, 258, 12, 'MB #31-B American Ford Station Wagon', 'In 1959 Lesney replaced the original 31-A Ford Station Wagon with an updated model.  A small number of the new 31-B models were released in the yellow paint of the original 31-A models but the vast majority appeared in a two-tone with metallic green body and pale pink roof with either a black or crimson color base.  Some models had no windows, some had clear and some had green tint plastic windows.  Most models rolled on either gray or silver plastic wheels but a short run with black plastic wheels came out just before the model was replaced within the range in 1964.', '', 1264472219, 1, '31B-110.jpg', '31B-110.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1913, 258, 12, 'MB #31-B American Ford Station Wagon- base and wheel variations', 'Seen here on the 31-B American Ford Station Wagon are both the black and crimson bases as well as the gray and silve plastic wheels.', '', 1264472219, 1, '31B-base_variations.jpg', '31B-base_variations.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1914, 258, 12, 'MB #31-C Lincoln Continental', 'In September of 1964 Lesney pulled the 31-B Ford Station Wagon but stayed within the American Ford line with the new 31-C Lincoln Continental model.  Early models appeared in metallic blue paint while later models showed up in a rather ugly sea green.  Just prior to the transition to ''Superfast'' wheels a small handful of these models came out with regular wheels but the transition color of metallic lime green.  Genuine examples are rare and highly prized', '', 1264472219, 1, '31C-158.jpg', '31C-158.jpg', '', 1, 0, 0, 0, '0.00', 36),
(1915, 258, 12, 'MB #32-A Jaguar XK140 coupe', 'In 1957 Lesney added a wonderful Jaguar XK140 coupe to the Matchbox range.  Most models appeared in off-white paint but a relatively small run in red came out prior to the model''s elimination in 1962.  Wheels were either metal or gray plastic on these models.', '', 1264472219, 1, '32A-34.jpg', '32A-34.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1916, 258, 12, 'MB #32-B ''E'' Type Jaguar coupe', 'It was September of 1962 when the time came to update the 32-A Jaguar XK140.  The replacement model, the 32-B ''E'' Type Jaguar coupe in beautiful metallic red  became one of the quintessential classics from Lesney''s regular wheel era.  The early models with gray wheels and green tinted windows are particularly hard to find but any of the 32-B models generally are quickly snapped up by eager collectors.  The introduction of detailed wire wheels really set this model off with newfound distinction.', '', 1264472219, 1, '32B-134.jpg', '32B-134.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1917, 258, 12, 'MB #32-C Leyland Petrol Tanker', 'In February of 1968 the time had come to replace the beloved 32-B ''E'' Type Jaguar within the Matchbox range.  A Leyland petrol tanker decked out in BP Petroleum paint and decals was added to the line.  The models had blue tinted windows and black plastic wheels.  A short run of models were released without chrome plating on the base and grill.  These white plastic grilled models are particularly sought.  Just as with the 25-C Bedford Petrol Tanker there was a short run of these models that appeared in a blue and white paint scheme and "Aral'' labels for the German market.  These models are difficult to find outside of Germany.  Internet sales have helped distribute these otherwise hard to find models aroudn the world.', '', 1264472219, 1, '32C-213.jpg', '32C-213.jpg', '', 1, 0, 0, 0, '0.00', 28),
(1918, 258, 12, 'MB #33-A Ford Zodiac', 'In 1957 Lesney added a European Ford Zodiac to the range.  Between body color, wheel color and tread count, window inserts, and casting differences this is one of those models that becomes a favorite among Matchbox variation collectors.  There are at least 20+ possible combinations on this one.', '', 1264472219, 1, '33A-35.jpg', '33A-35.jpg', '', 1, 0, 0, 0, '0.00', 40),
(1919, 258, 12, 'MB #33-B Ford Zephyr 6', 'In May of 1963 Lesney replaced the European Ford Zodiac with an updated European Ford Zephyr 6.  These models appeared in a dark sea-green with clear windows, cream interior and rolled on either black, gray, or silver plastic wheels.', '', 1264472219, 1, '33B-141.jpg', '33B-141.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1920, 258, 12, 'MB #33-C Lamborghini Miura', 'It was August of 1968 when Lesney removed the 33-B Ford Zephyr from the range and replaced it with the ultra exotic Lamborghini Miura in bright yellow.  The vast majority of these models appeared with red interior inserts but a handful of models showed up just before the transition to ''Superfast'' wheels that had white interiors.  An even smaller number had both the white interior and metallic gold color of the ''Superfast'' model released on regular wheel chassis''', '', 1264472219, 1, '33C-223.jpg', '33C-223.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1921, 258, 12, 'MB #34-A Volkswagen delivery van', 'Among vintage Matchbox collectors the #34 is known as the VW van/bus slot in the regular wheel range.  The first of the models, the 34-A delivery van in blue appeared in 1957.  The models sported ''Matchbox International Express'' side decals and rolled on either metal, gray plastic or the elusive silver plastic wheels.', '', 1264472219, 1, '34A-36.jpg', '34A-36.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1922, 258, 12, 'MB #34-A Volkswagen delivery van- gray wheel variation', '', '', 1264472219, 1, '34A-36_gray_wheels.jpg', '34A-36_gray_wheels.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1923, 258, 12, 'MB #34-A Volkswagen delivery van- silver plastic wheels', 'Even in rough condition this one is worth having because of the elusive silver plastic wheels.', '', 1264472219, 1, '34A-_Silver_plastic_wheels.jpg', '34A-_Silver_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 17),
(1924, 258, 12, 'MB #34-B Volkswagen Caravette', 'It was June of 1962 when the original small 34-A delivery VW van was replaced by a larger pale green VW camper/caravette van.  The side doors opened to reveal a detailed camper interiorWheels were either gray plastic, black plastic or elusive silver plastic wheels.', '', 1264472219, 1, '34B-131.jpg', '34B-131.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1925, 258, 12, 'MB #34-C Volkswagen Camper- high roofline', 'In January of 1967 the third of the VW van models hit the Matchbox range.  Early models had silver paint, amber window inserts and a high rise roof elevation.', '', 1264472219, 1, '34C-199.jpg', '34C-199.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1926, 258, 12, 'MB #34-C Volkswagen Camper- low roofline', 'During the production of the 34-C VW camper the model''s roofline was lowered.', '', 1264472219, 1, '34C-199_low_roofline.jpg', '34C-199_low_roofline.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1927, 258, 12, 'MB #34-C VW camper high & low roofline comparison', 'Seen here in profile is a comparison of the high and low roofline variations of the 34-C Volkswagen camper casting', '', 1264472219, 1, '34C-high_and_low_roofline_variations.jpg', '34C-high_and_low_roofline_variations.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1928, 257, 15, 'MB Mainline 1999 #367f ''99 Mustang Coupe-white', 'Daddy''s Dream', '', 1264472219, 1, 'IMG_1359.jpg', 'IMG_1359.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1929, 311, 15, 'MB Superfast 1994 #015 Mustang Mach lll-red', '', '', 1264472220, 1, 'IMG_1410.jpg', 'IMG_1410.jpg', '', 1, 0, 0, 0, '0.00', 38),
(1930, 311, 15, 'MB Superfast 1996 #015 Mustang Mach lll-dk Blue', '', '', 1264472220, 1, 'IMG_1400.jpg', 'IMG_1400.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1931, 272, 15, 'RC High Octane 2000 NASCAR series ''68 Mustang', '', '', 1264472220, 1, 'IMG_1374.jpg', 'IMG_1374.jpg', '', 1, 0, 0, 0, '0.00', 51),
(1932, 258, 12, 'mb #35-A Marshall Horse Box truck', 'In 1957 Lesney added a cute little Marshall horse box truck to the range using the ERF cab painted in red and a simulated wood horsebox painted in tan.  This is one of the few models that saw all four types of wheels used across it''s life in the Matchbox range; metal, gray plastic, silver plastic and black plastic.  Metal and gray wheels are most common.', '', 1264477900, 1, '35A-37.jpg', '35A-37.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1933, 258, 12, 'mb #35-A Marshall Horse Box truck- wheel variations', 'Here is the lineup showing all four wheel variations: metal, gray plastic, silver plastic and black plastic.  The silver and black plastic are the hard ones to find.', '', 1264477900, 1, '35A-_variations.jpg', '35A-_variations.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1934, 258, 12, 'MB #35-B Snow-Trac', 'After a long seven year run in the range the 35-A Marshall horsebox was replaced with the 35-B Snow-Trac in red with green windows and gray-white tracks', '', 1264477900, 1, '35B-157.jpg', '35B-157.jpg', '', 1, 0, 0, 0, '0.00', 19),
(1935, 258, 12, 'MB #36-A Austin A50 Cambridge', 'This tiny little Austin A50 Cambridge was added to the range in 1957.  Models appeared in a blue-green or truer pale blue paint color.  Wheels can be metal or gray plastic', '', 1264477901, 1, '36A-38.jpg', '36A-38.jpg', '', 1, 0, 0, 0, '0.00', 18),
(1936, 277, 15, 'HW Classic SE Hills ''70 Mach 1 - red', '', '', 1264477944, 1, 'IMG_1414.jpg', 'IMG_1414.jpg', '', 1, 0, 0, 0, '0.00', 60),
(1937, 258, 12, 'MB #36-B Lambretta TV 175 scooter and sidecar', 'In February of 1961 the tiny 36-A Austin A50 was replaced in the range by the 36-B Lambretta scooter painted in metallic green.  This was the first of what eventually would be four motorcycle/scooter castings in the range.', '', 1264519599, 1, '36B-115.jpg', '36B-115.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1938, 258, 12, 'MB #36-C Opel Diplomat', 'In May of 1966 the Lambretta scooter was replaced with the 36-C Opel Diplomat painted in metallic gold with white interior and black wheels.  Some of the engines were chrome plated.  Others were not.', '', 1264519600, 1, '36C-187.jpg', '36C-187.jpg', '', 1, 0, 0, 0, '0.00', 36),
(1939, 258, 12, 'MB #37-A Coca-Cola Karrier Bantam', 'Another of the classics from the Matchbox line, the line of Coca-Cola lorries was initiated in the range in 1957.  The first edition models were either yellow or orange-yellow and rolled on either metal or gray plastic wheels.  On some models the Coca-Cola cases are nice and even.  On the earlier models the Cola bottle stacks are uneven in spots.  These early models had no base.', '', 1264519600, 1, '37A-39.jpg', '37A-39.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1940, 258, 12, 'MB #37-B Coca-Cola Karrier Bantam', 'In 1960 the 37-A Coca-Cola Lorries received a subtle facelift.  The models were fitted with a base and the casting was made sharper.  Wheels were either gray, silver or black plastic.', '', 1264519600, 1, '37B-111.jpg', '37B-111.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1941, 258, 12, 'MB #37-C Dodge Cattle Truck', 'In February of 1966 the beloved Coca-Cola lorry was replaced within the range by a Dodge powered Cattle truck.  The yellow cabbed models had plastic simulated wood cattle boxes that varied in color from green to brown.  Each truck was equipped with a pair of white plastic steers.', '', 1264519600, 1, '37C-183.jpg', '37C-183.jpg', '', 1, 0, 0, 1, '10.00', 24),
(1942, 258, 12, 'MB #38-A Karrier Refuse/garbage collector', 'In 1957 Lesney added a garbage/refuse truck to the Matchbox range.  Early models of this Karrier powered truck were painted in a light gray-brown.  Today those models are very hard to find.  Most models appear in the dark gray that was common to the bulk of this models life.  The tail end of the line were painted in silver.  Wheels range from metal to gray and silver plastic.', '', 1264519600, 1, '38A-40.jpg', '38A-40.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1943, 258, 12, 'MB #38-B Vauxhall Victor Estate Wagon', 'In May of 1963 the 38-A Karrier Refuse truck was replaced by this nice little Vauxhall Victor Estate car.  These models were all painted in pale yellow with either red or light green interior and either gray, silver or black plastic wheels.', '', 1264519600, 1, '38B-142.jpg', '38B-142.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1944, 258, 12, 'MB #38-C Honda motorcycle and trailer', 'In September of 1967 Lesney added the fourth and final motorcycle to the range.  Previous efforts made use of a sidecar to hold the models erect but in this case the small blue Honda dirt bike was wedged into wheel slots within the trailer base to keep the bike vertical.  The trailers showed variation in color, decal size and the casting itself.  The motorcycles too had some subtle casting variations.  There is a large number of possilbe combinations/variations with this one.', '', 1264519600, 1, '38C-209.jpg', '38C-209.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1945, 258, 12, 'MB #39-A Ford Zodiac convertible', 'In 1957 Lesney added a sporty Ford Zodiac convertible to the range.  The body was painted in a peach with more interiors and bases in a blue-green color.  Early models featured a tan colored base and interior.  Those models are highly treasured today.  Wheels were metal, gray or silver plastic', '', 1264519600, 1, '39A-41.jpg', '39A-41.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1946, 258, 12, 'MB #39-B Pontiac convertible', 'In March of 1962 the Ford Zodiac convertible was replaced by a handsome American alternative,  the 39-B Pontiac.  Early models were painted in a metallic purple and most of these went to countries outside the US.  My versioni came from an Australian friend.  Most models came in a pale yellow color with cream interior and either  a red or cream steering wheel.  Base colors varied from black to crimson.  Wheels could be gray, silver or black plastic with gray being the hardest to find on this one.', '', 1264519600, 1, '39B-128.jpg', '39B-128.jpg', '', 1, 0, 0, 0, '0.00', 44),
(1947, 258, 12, 'MB #39-B Pontiac convertible- base and wheel variations', 'Seen here are the black and crimson bases on the 39-B Pontiac convertible.  Also seen here are silver and black plastic wheels.', '', 1264519707, 1, '39B-_base_variations.jpg', '39B-_base_variations.jpg', '', 1, 0, 0, 0, '0.00', 20),
(1948, 258, 12, 'MB #39-C Ford Tractor', 'In May of 1967 the 39-B Pontiac convertible was replaced by a Ford Tractor.  Early models had a blue body and yellow engine cover.  Later models appeared all in blue.  Black tires rolled on yellow plastic wheels.  While the orange painted model still rolls on ''regular/non-Superfast'' wheels, this model comes from a set made after the true end of the ''regular wheel'' era.  I''ve welcomed this one into my collection nonetheless.', '', 1264519707, 1, '39C-202.jpg', '39C-202.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1949, 258, 12, 'MB #39-C Ford Tractor pulling the 40-C Hay wagon', 'Released along with the 39-C Ford tractor was a color coordinated hay wagon.', '', 1264519707, 1, '39C__40C.jpg', '39C__40C.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1950, 191, 7, 'M2 Auto-Thentics R9 ''55 DeSoto Fireflite - White/Blue', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553042, 1, 'm2a9-01.jpg', 'm2a9-01.jpg', '', 1, 0, 0, 0, '0.00', 104),
(1951, 191, 7, 'M2 Auto-Thentics R9 ''54 Dodge Royal - Black', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553042, 1, 'm2a9-02.jpg', 'm2a9-02.jpg', '', 1, 0, 0, 0, '0.00', 97),
(1952, 191, 7, 'M2 Auto-Thentics R9 ''57 DeSoto Adventurer - White/Gold', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553042, 1, 'm2a9-03.jpg', 'm2a9-03.jpg', '', 1, 0, 0, 0, '0.00', 108),
(1953, 191, 7, 'M2 Auto-Thentics R9 ''57 Chrysler 300C - Orange', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553042, 1, 'm2a9-04.jpg', 'm2a9-04.jpg', '', 1, 0, 0, 0, '0.00', 112),
