(1956, 314, 7, 'M2 Detroit-Muscle R10 ''71 Dodge Charger Super Bee HEMI - Red', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553275, 1, 'm2d10-01.jpg', 'm2d10-01.jpg', '', 1, 0, 0, 0, '0.00', 106),
(1957, 314, 7, 'M2 Detroit-Muscle R10 ''71 Plymouth HEMI Cuda - Black', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553275, 1, 'm2d10-02.jpg', 'm2d10-02.jpg', '', 1, 0, 0, 0, '0.00', 128),
(1958, 314, 7, 'M2 Detroit-Muscle R10 ''69 Plymouth HEMI Road Runner - White', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553276, 1, 'm2d10-03.jpg', 'm2d10-03.jpg', '', 1, 1, 0, 0, '0.00', 129),
(1959, 314, 7, 'M2 Detroit-Muscle R10 ''70 Dodge Super Bee HEMI - Green', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553276, 1, 'm2d10-04.jpg', 'm2d10-04.jpg', '', 1, 0, 0, 0, '0.00', 98),
(1960, 314, 7, 'M2 Detroit-Muscle R10 ''69 Dodge Charger Daytona HEMI - Brown', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553276, 1, 'm2d10-05.jpg', 'm2d10-05.jpg', '', 1, 0, 0, 0, '0.00', 80),
(1961, 314, 7, 'M2 Detroit-Muscle R10 ''66 Dodge Charger HEMI - Blue', 'photo provided by \r\n<a href="http://milezone.com" target=blank>MileZone</a>', '', 1264553276, 1, 'm2d10-06.jpg', 'm2d10-06.jpg', '', 1, 0, 0, 0, '0.00', 95),
(1962, 298, 7, 'MileZone 2010 Diorama #01', 'This was the main diorama we used for our 2009 photos.  We plan to use the same in 2010 but will be adding some tire racks, and other cool things.', '', 1264553606, 1, 'dio01.jpg', 'dio01.jpg', '', 1, 0, 0, 0, '0.00', 196),
(1963, 298, 7, 'MileZone 2010 Diorama #02', 'This is the new 2010 Diorama.  This one will be used for the "country" feel.', '', 1264553606, 1, 'dio02.jpg', 'dio02.jpg', '', 1, 1, 0, 1, '10.00', 239),
(1964, 258, 12, 'MB #40-A Bedford 7-ton tipper', 'Once again in 1957 Lesney used the familiar Bedford cab to power a 7-ton tipper truck.  The cab and chassis were red and the tipper is tan.  These models appeared with either metal or gray plastic wheels.', '', 1264560594, 1, '40A-42.jpg', '40A-42.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1965, 258, 12, 'MB #40-B Leyland Royal Tiger Coach', 'In April of 1961 Lesney replaced the 40-A Bedford tipper truck with a futuristic over the road luxury coach, the Leyland Royal Tiger.  The models were painted in steel blue with green windows and either silver, black or rarely gray plastic wheels.', '', 1264560594, 1, '40B-119.jpg', '40B-119.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1966, 258, 12, 'MB #40-C Hay Trailer', 'The 40-C Hay Trailer was introduced in may of 1967 in tandem with the 39-C Ford Tractor.  These models were painted in blue with yellow plastic hay retention racks and black tires on yellow plastic wheels.  Even after the regular wheel era ended in 1969 Matchbox occasionally introduced farm twin-packs that included the old Hay Trailer in new assorted colors and solid regular wheels.  This yellow model would be an example.', '', 1264560594, 1, '40C-203.jpg', '40C-203.jpg', '', 1, 0, 0, 0, '0.00', 25),
(1967, 258, 12, 'MB #41-A D-type Jaguar', 'In 1957 Lesney introduced a wonderful D-type Jaguar racer in British racing green.  The driver was painted tan and each was numbered with a round #41 decal.  Most of these models like this one rolled on metal wheels.  At the tail end of the run some left the factory on gray plastic wheels (see additional photo)', '', 1264560594, 1, '41A-43.jpg', '41A-43.jpg', '', 1, 0, 0, 0, '0.00', 35),
(1968, 258, 12, 'MB #41-A D-type Jaguar- hard to find gray plastic wheels', 'The last run of these handsome Jaguar racers left the factory on gray plastic wheels.', '', 1264560594, 1, '41B-_fine_tread_gray_plastic_wheels.jpg', '41B-_fine_tread_gray_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 42),
(1969, 258, 12, 'MB #41-B D-type Jaguar', 'In 1960 Lesney enlarged the first D-type Jaguar racer.  Like the first model these were painted in British racing green with #41 decals  The newer larger D-type was manufactured with a variety of tire and wheel types.  Early models had gray plastic wheels.  Later models were dramatically enhanced with wire wheels on black plastic tires.  At the tail end of this model''s run a handful were put together with red plastic wheels.  These are the gems from among these variations.', '', 1264560594, 1, '41B-112.jpg', '41B-112.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1970, 258, 12, 'MB #41-B D-type Jaguar- fine tread gray plastic wheels', '', '', 1264560594, 1, '41B-_fine_tread_gray_plastic_wheels_2.jpg', '41B-_fine_tread_gray_plastic_wheels_2.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1971, 258, 12, 'MB #41-B D-type Jaguar- rare red plastic wheels', 'This one has a red backdrop for two reasons; the red goes nicely with the rare red plastic wheels demonstrated on this model.  Secondly, red is a Christmas color and I found this guy hidden amongst a group of random diecast toys this past Christmas.', '', 1264560595, 1, '41B-red_wheels-_rear.jpg', '41B-red_wheels-_rear.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1972, 258, 12, 'MB #41-C Ford GT-40', 'The Ford GT-40 replaced the D-type Jaguar within the range in 1965.  A short run of models left the factory on the same red plastic wheels that it''s Jaguar predecessor had used for a brief time.  These red wheeled examples are genuine treasures.  Most models had yellow wheels with black tires.  The yellow model is somewhat hard to find and was available only in a Matchbox racing gift set.', '', 1264560595, 1, '41C-181.jpg', '41C-181.jpg', '', 1, 0, 0, 0, '0.00', 39),
(1973, 258, 12, 'MB #42-A Bedford Evening News van', 'In 1957 Lesney went back for a third time to the Bedford van in creating the wonderful yellow Evening News van.  These models were released most often with metal or gray plastic wheels but a short run of black wheeled models finished up this model''s run.  The red model is NOT a production model but rather a very nice custom depicting a scheme that had appeared in early Lesney literature.', '', 1264560595, 1, '42A-44.jpg', '42A-44.jpg', '', 1, 0, 0, 0, '0.00', 34),
(1974, 258, 12, 'MB #42-B Studebaker Lark Wagonaire', 'In January of 1965 the popular Bedford Evening News van was replaced after a lengthy eight year stay in the range.  The new model depicted the unique Studebaker Lark Wagonaire with it''s creative sliding roofline.  These models were painted in varying shades of blue and the roof slide generally was lighter than the body color.  Occasionally eagle eyed collectors will find a modlel with a roof slide that matches the body blue.  Each model had a white interior, clear windows and a white plastic hunter with hunting dog.', '', 1264560595, 1, '42B-161.jpg', '42B-161.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1975, 258, 12, 'MB #8-A Caterpillar tractor- rare early issue', 'Seen here is a newly acquired example of the first issue of the 8-A Caterpillar tractor.  When production first started the rollers and axles were placed onto the body before painting.  These early models with yellow rollers and axles are quite elusive.', '', 1264560595, 1, '001.jpg', '001.jpg', '', 1, 0, 0, 0, '0.00', 21),
(1976, 258, 12, 'MB #42-C Iron Fairy Crane', 'This casting holds the sad distinction of being the last of 236 assorted castings that graced the Matchbox regular wheel line from 1953-1969.  It was August of 1969 when the Iron Fairy Crane replaced the 42-B Studebaker Lark Wagonaire in the Matchbox range.  Models were painted in red with a yellow crame jib.  Models released after this one fall into the ''Lesney Superfast'' era of Matchbox history.', '', 1264564622, 1, '42C-236.jpg', '42C-236.jpg', '', 1, 0, 0, 0, '0.00', 27),
(1977, 258, 12, 'MB #43-A Hillman Minx', 'Early in 1958 Lesney added a Hillman Minx to the Matchbox range.  The initial run was painted in a rather ho-hum green and those models today are much more collectible than the more common flashy two-tone models that made up the vast majority of this model''s run.  Following the brief initial green run models came out with a blue-gray body and pale gray roof.  The final run was turquois with a cream roof.  These models rolled on either metal or gray plastic wheels', '', 1264564622, 1, '43A-49.jpg', '43A-49.jpg', '', 1, 0, 0, 0, '0.00', 45),
(1978, 258, 12, 'MB #43-B Aveling Barford tractor shovel', 'The Aveling Barford tractor replaced the little Hillman Minx in August of 1962.   All of these bodies featured yellow paint.  Most of the models had either a red shovel or a red driver and base piece.  A handful of models were produced either in solid yellow or with both a red shovel and driver/base.  These later variations are rather elusive.', '', 1264564622, 1, '43B-133.jpg', '43B-133.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1979, 258, 12, 'MB #43-C Pony trailer', 'In 1968 the Aveling Barford shovel tractor was replaced by a yellow pony trailer.  Earl models had a tan base.  Later models ahd a dark green base.  Each model came equipped with a pair of ponies.', '', 1264564622, 1, '43C-216.jpg', '43C-216.jpg', '', 1, 0, 0, 0, '0.00', 33),
(1980, 258, 12, 'MB #44-A Rolls Royce Silver Cloud', 'In 1958 Lesney ventured into the high-brow realm with the introduction of a handsome Rolls Royce Silver Cloud in classy metallic blue.  These models can be found on metal, gray or silver plastic wheels.', '', 1264564622, 1, '44A-50.jpg', '44A-50.jpg', '', 1, 0, 0, 0, '0.00', 38),
(1981, 258, 12, 'MB #44-B Rolls Royce Phantom V', 'In February of 1964 Lesney updated the original 44-A Rolls Silver Cloud with a new Phantom V casting.  Early models appeared in a metallic mauve while later models showed silver-gray paint.  Most of these models appeared with black plastic wheels but a small number of gray or silver plastic wheeled models can be found', '', 1264564622, 1, '44B-149.jpg', '44B-149.jpg', '', 1, 0, 0, 0, '0.00', 36),
(1982, 258, 12, 'MB #44-C G.M.C. Refrigerator Truck', 'In 1967 the Rolls Royce Phantom V was replaced within the Matchbox range with a humble G.M.C. refrigerator truck with red body and green container.', '', 1264564623, 1, '44C-204.jpg', '44C-204.jpg', '', 1, 0, 0, 0, '0.00', 23),
(1983, 258, 12, 'MB #45-A Vauxhall Victor', 'In 1958 Lesney added a Vauxhall Victor to the range.  This would have been one of those bread and butter automobiles on the streets of London in 1958.  An early tiny run of models in red are nearly mythical in regard.  Almost never do red models surface on the collector market.  The vast majority of models appear in the pale yellow you see here.  Early models had no windows but later models had either clear or green tinted windows.  Metal and gray wheels are common while silver and black plastic wheels are found on a much less frequent basis.', '', 1264564623, 1, '45A-51.jpg', '45A-51.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1984, 258, 12, 'MB #45-A Vauxhall Victor- hard to find black plastic wheels', 'The elusive final run of these models appeared with black plastic wheels', '', 1264564623, 1, '45A-_black_plastic_wheels.jpg', '45A-_black_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1985, 258, 12, 'MB #45-A Vauxhall Victor- hard to find sivler plastic wheels.', '', '', 1264564623, 1, '45A-_silver_wheels.jpg', '45A-_silver_wheels.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1986, 258, 12, 'MB #45-B Ford Corsair', 'It was February of 1965 when Lesney replaced the 45-A Vauxhall Victor with a cream colored Ford Corsair that came equipped with a roof-rack and rowboat.  Most wheels were black plastic but occasionally models surface with gray plastic wheels.', '', 1264564623, 1, '45B-163.jpg', '45B-163.jpg', '', 1, 0, 0, 0, '0.00', 76),
(1987, 258, 12, 'MB #46-A Morris Minor 1000', 'In 1958 Lesney added a humble little Morris Minor to the Matchbox range.  What today has become on of the most popular models among Matchbox  collectors did not sell particularly well when it was originally released.  Indeed the model was replaced within the range after two short years because of poor sales.  \nA painfully short run of tan colored models started this range.  The one pictured here is a FAKE example.  Real examples in nice condition sell for thousands of dollars!  No kidding.  Almost immediately Lesney switched to a very deep green body paint, later going to a dark blue-green and wrapping up with a short run of models in blue.  The dark green and dark blue-green models are by far the most common.  These models rolled on either metal or gray plastic wheels.', '', 1264564623, 1, '46A-_color_group.jpg', '46A-_color_group.jpg', '', 1, 0, 0, 0, '0.00', 119),
(1988, 258, 12, 'MB #46-A Morris Minor 1000- blue models', 'The final run of Morris Minor models came out in this lovely blue.  One of these models is a provocative example with metal wheels.  In theory the blue models should only exist with gray plastic wheels.  Some so-called experts have examined this model and accepted it as authentic.  Others have said the axles show evidence of tampering.  We''ll never know for sure.', '', 1264564623, 1, '46A-blue-52.jpg', '46A-blue-52.jpg', '', 1, 0, 0, 0, '0.00', 45),
(1989, 258, 12, 'MB #46-A Morris Minor 1000- green and blue-green models', 'The difference between the true dark green models and dark blue-green is rather subtle and easy to miss on first glance.', '', 1264564623, 1, '46A-green-52.jpg', '46A-green-52.jpg', '', 1, 0, 0, 0, '0.00', 37),
(1990, 258, 12, 'MB #46-B Pickford Removal Van', 'In October of 1960 Lesney introduced a large Guy powered removals van with Pickfords Livery on the sides.  Early models were painted in this deep blue.  The two line decal is a much more difficult to find variation.  Later models appeared in green.  Wheels were either gray, silver, or black plastic.  A very short promotional run painted in tan was done for distribution in ''Beales Bealeson'' department stores.  These models go today for a high premium price', '', 1264565603, 1, '46B-blue_105.jpg', '46B-blue_105.jpg', '', 1, 0, 0, 0, '0.00', 29),
(1991, 258, 12, 'MB #46-B Pickford Removal Van- hard to find dark blue with SILVER plastic wheels', 'Dark blue examples with Silver plastic wheels are quite elusive', '', 1264565603, 1, '46B-_blue_with_silver_plastic_wheels.jpg', '46B-_blue_with_silver_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1992, 258, 12, 'MB #46-B Pickford Removal Van- green variations', 'The green variations on the Pickford''s vans are perhaps the most common.', '', 1264565603, 1, '46B-green_105.jpg', '46B-green_105.jpg', '', 1, 0, 0, 0, '0.00', 32),
(1993, 258, 12, 'MB #46-C Mercedes Benz 300SE', 'In 1968 Lesney replaced the Pickfords Removal Van with a new Mercedes Benz 300SE.  Early models were painted in green with later examples appearing in metallic blue.  Windows were clear plastic with a cream interior.  This model was the first done by Lesney with both an opeing truck and doors', '', 1264565603, 1, '46C-214.jpg', '46C-214.jpg', '', 1, 0, 0, 0, '0.00', 24),
(1994, 258, 12, 'MB #47-A 1-ton Trojan van', 'In 1958 Lesney added a bright red 1-ton Trojan Van with ''Brooke Bond Tea'' livery.  These models appeared with metal or gray plastic wheels', '', 1264603470, 1, '47A-53.jpg', '47A-53.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1995, 258, 12, 'MB #47-B Commer Ice Cream Canteen', 'In March of 1963 Lesney replaced the 47-A Brooke Bond Tea van with a Commer Ice Cream Canteen tan.  Because of the assortment of body colors, decals, wheels and even the ice cream man inside the van this casting is a favorite among variation collectors.  There are at least 25 possible variations on this one!', '', 1264603471, 1, '47B-140.jpg', '47B-140.jpg', '', 1, 0, 0, 0, '0.00', 31),
(1996, 258, 12, 'MB #47-B Commer Ice Cream Canteen- color and decal variations', 'When the 47-B Commer Ice Cream Canteen was first released in March of 1963 the early models were painted in metallic blue.  This was a brief run and today these models are difficult to find.  Non metallic blue models came next and are the most common.  Cream models are fairly common and brought up the rear in this model''s run within the Matchbox range.  You also can see here some of the decal variations.', '', 1264603471, 1, '47B-_color_variations.jpg', '47B-_color_variations.jpg', '', 1, 0, 0, 0, '0.00', 30),
(1997, 258, 12, 'MB #47-B Commer Ice Cream Canteen- variations', 'The gray plastic wheel variations are really quite elusive.  Also you can see here that the ice cream man came in assorted heights!', '', 1264603471, 1, '47B-_man_variations.jpg', '47B-_man_variations.jpg', '', 1, 0, 0, 0, '0.00', 39),
(1998, 258, 12, 'MB #47-C DAF Tipper Container Truck', 'In June of 1968 Lesney removed the Commer Ice cream canteen from the range and added a DAF Tipper conatiner truck in the #47 slot.  Early models were painted in sea-green  with later models showing up with silver bodies.', '', 1264603471, 1, '47C-220.jpg', '47C-220.jpg', '', 1, 0, 0, 0, '0.00', 26),
(1999, 258, 12, 'MB #48-A Meteor Sportsman boat', 'In 1958 Lesney added a new toy to pulled behind those cars they had introduced with towing hitches.  The Meteor Sportsman sat atop a trailer that rolled on either metal or gray plastic  or rarely silver plastic wheels.', '', 1264603471, 1, '48A-54.jpg', '48A-54.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2000, 258, 12, 'MB #48-B Sports boat and trailer', 'In March of 1961 Lesney updated the boat in the #48 slot within the range.  While the new trailer was die-cast metal, the new boat was made of plastic.  Boats were a mix of red and white with assorted combinations; red deck white hull or white deck and red hull.  Most boat motors were gold painted while a select few were done in silver.  Gray wheels on the trailer were very hard to find.', '', 1264603471, 1, '48B-123.jpg', '48B-123.jpg', '', 1, 0, 0, 0, '0.00', 22),
(2001, 258, 12, 'MB #48-C Dodge Dumper Truck', 'In September of 1966  Lesney replaced the 48-B Sport boat and trailer with a bright red new Dodge dumper truck.', '', 1264603471, 1, '48C-191.jpg', '48C-191.jpg', '', 1, 1, 0, 0, '0.00', 43),
(2002, 258, 12, 'MB #49-A M3 Personnel Carrier', 'In 1958 Lesney added the first of many to come military vehicles to the Matchbox range.  Models were painted in military olive green.  The front wheels could be metal, gray plastic or black plastic.  The rear rollers were metal, gray, silver or black plastic.', '', 1264603471, 1, '49A-55.jpg', '49A-55.jpg', '', 1, 0, 0, 0, '0.00', 36),
(2003, 258, 12, 'MB #49-B Mercedes Unimog', 'After a long nine year run Lesney removed the 49-A miliary personnel carrier from the Matchbox range in February of 1967 and replaced it with a fun Mercedes Unimog.  Early models had a tan body and sea green base.  Later models had a blue body and red base.  Black tires rolled on yellow plastic wheels', '', 1264603471, 1, '49B-200.jpg', '49B-200.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2004, 258, 12, 'MB #50-A Commer Pickup MK VIII', 'In 1958 Lesney added a Commer Pickup truck to the range in a pale brown color.  Wheels were either metal or gray or silver plastic.  A short run of red body and white roofed models replaced the pale brown but very quicklly the white roof was changed to pale gray.  These red models rolled on silver, gray or black plastic models.', '', 1264603471, 1, '50A-56.jpg', '50A-56.jpg', '', 1, 0, 0, 0, '0.00', 33),
(2006, 258, 12, 'MB #50-B John Deere tractor', 'In August of 1964 Lesney replaced the Commer pickup with a popular new John Deere Tractor.  Black or gray plastic tires rolled on yellow plastic wheels.', '', 1264603471, 1, '50B-155.jpg', '50B-155.jpg', '', 1, 0, 0, 0, '0.00', 31),
(2007, 258, 12, 'MB #50-B John Deere tractor with 51-B tipper trailer', 'When Lesney released the John Deere Tractor in August of 1964 they also released the 51-B tipper trailer also in John Deere green and yellow.   Trailers came equipped with three yellow plastic barrels', '', 1264603471, 1, '50B_with_51B.jpg', '50B_with_51B.jpg', '', 1, 0, 0, 0, '0.00', 32),
(2008, 258, 12, 'MB #50-C Ford Kennel Truck', 'In March of 1969 Lesney released a green Ford pickup truck with green tinted windows and a load of four white plastic dogs stowed out back on the bed.  Early models had an unplated white plastic grill.  Later models had chrome plated grills.', '', 1264603471, 1, '50C-234.jpg', '50C-234.jpg', '', 1, 0, 0, 0, '0.00', 44),
(2009, 258, 12, 'MB #51-A Albion Chieftan cement truck', 'In 1958 Lesney added a nice little Albion Chieftan cement truck to the range.  The body was painted in yellow with the cement sacks on the bed covered in assorted shades of pale brown.  Wheels were commonly metal and gray plastic, uncommonly silver or black plastic.  The very first issue of these models appeared with a side decal that reads ''Portland Cement'' only.  This model is much harder to find than the more common decal varients.', '', 1264637100, 1, '51A-57.jpg', '51A-57.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2010, 258, 12, 'MB #51-A Albion Chieftan cement truck- hard to find silver plastic wheels', 'Even in a paint chipped condition this model is a keeper with the silver plastic wheels.', '', 1264637100, 1, '51A-57-_silver_wheels.jpg', '51A-57-_silver_wheels.jpg', '', 1, 0, 0, 0, '0.00', 37),
(2011, 258, 12, 'MB #51-B John Deere tipper trailer', 'In August of 1964 the Albion Chieftan cement truck was replaced by 51-B, a trailer intended to go with the 50-B John Deere tractor.  The trailer came with a trio of yellow plastic barrels.', '', 1264637100, 1, '51B-156.jpg', '51B-156.jpg', '', 1, 0, 0, 0, '0.00', 25),
(2012, 258, 12, 'MB #51-C AEC 8-wheel tipper truck', 'In January of 1961 the 51-B John Deere trailer was replaced by the 51-C AEC 8-wheel tipper.  Original models were painted with an orange cab and silver tipper with a ''Douglas'' livery on the sides of the tipper.  Later issues changed to a yellow cab color.  The final models in this run had the yellow cab with a change in the side labels to ''Pointer'' (see additional photo)', '', 1264637100, 1, '51C-230Douglas.jpg', '51C-230Douglas.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2013, 258, 12, 'MB #51-C AEC 8-wheel tipper truck- final edition', 'The final AEC 8-wheel tipper models done by Lesney featured a yellow cab and ''Pointer'' labels.', '', 1264637100, 1, '51C-230Pointer.jpg', '51C-230Pointer.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2014, 258, 12, 'MB #52-A Maserati 4CLT open-wheel racer', 'In 1958 Lesney added a wonderful #52-A Maserati racer to the Matchbox range.  Early models appeared in red with a white driver, black base and black plastic wheels.  Most but not all of these models were dressed up with #52 decals.  The final run of red models were fitted with the fancy wire-wheels that came on the final versions of this model that were painted in bright yellow.', '', 1264637100, 1, '52A-58.jpg', '52A-58.jpg', '', 1, 0, 0, 0, '0.00', 32),
(2015, 258, 12, 'MB #52-B B.R.M. open wheel racer', 'In September of 1965 Lesney replaced the original 52-A Maserati racer with an updated rear-engine open wheel B.R.M. racer in blue.  Later models painted in red appeared in a race gift set', '', 1264637100, 1, '52B-175.jpg', '52B-175.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2016, 258, 12, 'MB #53-A Aston Martin DB4 Mk I', 'In 1958 Lesney added a wonderfully British model to the range, the 53-A Aston Martin.  It is said the model was patterned on Lesney pioneer Jack Odell''s personal car.  Early models appeared in metallic green but later models saw the green replaced with a lovely metallic red.', '', 1264637100, 1, '53A-59.jpg', '53A-59.jpg', '', 1, 0, 0, 0, '0.00', 35),
(2017, 258, 12, 'MB #53-B Mercedes Benz 220SE', 'In February of 1963 Lesney replaced the 53-A Aston Marton with the 53-B Mercedes-Benz 220SE.  Early models appeared in deep maroon.  Later models had a lighter red.  Wheels were either silver, gray or black plastic.', '', 1264637100, 1, '53B-139.jpg', '53B-139.jpg', '', 1, 0, 0, 0, '0.00', 34);
INSERT INTO `fproject_images` (`image_id`, `cat_id`, `user_id`, `image_name`, `image_description`, `image_keywords`, `image_date`, `image_active`, `image_media_file`, `image_thumb_file`, `image_download_url`, `image_allow_comments`, `image_comments`, `image_downloads`, `image_votes`, `image_rating`, `image_hits`) VALUES
(2018, 258, 12, 'MB #53-C Ford Zodiac VKIV', 'In January of 1968 Lesney replaced the Mercedes Benz 220SE with the 53-C Ford Zodiac MKIV.  Models were painted in metallic blue with clear windows and cream interior.  Just prior to the ''Superfast'' transition a handful of regular wheel models left the factory painted in the metallic green that had been selected for the Superfast models.', '', 1264637100, 1, '53C-211.jpg', '53C-211.jpg', '', 1, 0, 0, 0, '0.00', 43),
(2019, 258, 12, 'MB #54-A Saracen Personnel Carrier', 'In 1958 Lesney added a second military vehicle to the range, the 54-A Saracen Personnel Carrier.  Models were painted in military olive green and rolled on black plastic wheels', '', 1264637100, 1, '54A-60.jpg', '54A-60.jpg', '', 1, 0, 0, 0, '0.00', 28),
(2020, 258, 12, 'MB #54-B Cadillac Ambulance', 'In August of 1965 the Saracen Personnel Carrier was replaced by the Cadillac Ambulance.  Models were painted in white with black plastic wheels, blue windows, red roof dome and red cross door decals', '', 1264637101, 1, '54B-173.jpg', '54B-173.jpg', '', 1, 0, 0, 0, '0.00', 35),
(2021, 258, 12, 'MB #55-A D.U.K.W.', 'In 1958 Lesney added a military green D.U.K.W. water troop landing craft.  Wheels were metal, gray or black plastic.', '', 1264637101, 1, '55A-61.jpg', '55A-61.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2022, 258, 12, 'MB #55-A D.U.K.W.- black wheels', '', '', 1264637101, 1, '55A-_black_plastic_wheels.jpg', '55A-_black_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2023, 258, 12, 'MB #55-B Ford Fairlane Police car', 'In February of 1963 Lesney replaced the military D.U.K.W. with a Ford Fairlane police car.  A short run of models in dark blue came off the line first but the color rapidly was switched to a ligher metallic blue.  Wheels were mostly black plastic but some escaped the factory rolling on either silver or gray plastic', '', 1264637101, 1, '55B-138.jpg', '55B-138.jpg', '', 1, 0, 0, 0, '0.00', 63),
(2024, 258, 12, 'MB #55-B Ford Fairlane Police car- errant base', 'Seen here is a pair of 55-B Ford Fairlane police models.  One model is fitted with the typical base.  The other has an errantly placed base from the 59-B Fairlane fire chief cars', '', 1264637101, 1, '55B-_normal_and_errant_base.jpg', '55B-_normal_and_errant_base.jpg', '', 1, 0, 0, 0, '0.00', 41),
(2025, 258, 12, 'MB #55-B Ford Fairlane Police car- paint color variations', 'On the left the hard to find dark blue models is seen contrasting to the common lighter metallic blue', '', 1264637101, 1, '55B-_color_variations.jpg', '55B-_color_variations.jpg', '', 1, 0, 0, 0, '0.00', 37),
(2026, 258, 12, 'MB #55-B Ford Fairlane Police car- silver wheels', 'This 55-B Fairlane police cruiser rolls on hard to find silver plastic wheels.  These are replacement decals placed to enhance visual display impact.', '', 1264637101, 1, '55B-_silver_plastic_wheels.jpg', '55B-_silver_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 30),
(2027, 258, 12, 'MB #55-C Ford Galaxie Police Car', 'In 1966 Lesney updated the Ford police cruiser in the #55 slot within the range using a white Ford Galaxie as the new model.  Windows were clear, interior white and wheels black plastic.  The roof dome should be red but a handful of models done with a blue dome light were produced at the start', '', 1264637101, 1, '55C-_decal_hood__labels_doors.jpg', '55C-_decal_hood__labels_doors.jpg', '', 1, 0, 0, 0, '0.00', 34),
(2028, 258, 12, 'MB #55-C Ford Galaxie Police Car', 'On the 55-C Galaxie Police car the hood and door decoration could be decals, paper labels or a mix of both (see additional photo)', '', 1264637102, 1, '55C-194.jpg', '55C-194.jpg', '', 1, 0, 0, 0, '0.00', 33),
(2029, 258, 12, 'MB #55-D Mercury Police Car', 'In 1968 Lesney once again updated the police car in the 55 slot within the range.  The 55-D Mercury police car was painted in white with clear windows and cream interior.  Dome light was typically blue but some models are found with red.', '', 1264637102, 1, '55D-228.jpg', '55D-228.jpg', '', 1, 0, 0, 0, '0.00', 45),
(2030, 298, 7, 'MileZone "The Rest Stop" Diorama', 'This is the #3 diorama we are using for the 2010 season.  This one is just a laid mback rest stop feel.', '', 1264637102, 1, 'reststop.jpg', 'reststop.jpg', '', 1, 0, 0, 0, '0.00', 166),
(2031, 258, 12, 'MB #56-A London Trolleybus', 'In 1958 Lesney added a London Trolleybus to the range in the #56 slot.  Early models have black poles up top and they are quite hard to find.  Wheels vary from metal to gray and black plastic.', '', 1264638981, 1, '56A-62.jpg', '56A-62.jpg', '', 1, 0, 0, 0, '0.00', 31),
(2032, 258, 12, 'MB #56-B Fiat 1500', 'In July of 1965 Lesney replaced the 56-A London Trolleybus with the 56-B Fiat 1500 in a sea green color with a roof rack full of plastic luggage.  A red model later appeared as part of a gift set and they are much harder to find.  (see additional photo)', '', 1264638981, 1, '56B-171.jpg', '56B-171.jpg', '', 1, 0, 0, 0, '0.00', 32),
(2033, 258, 12, 'MB #56-B Fiat 1500- red model in gift set', 'Here is the harder to find red model of the Fiat 1500 still inside the gift set within which it came.', '', 1264638981, 1, '56B-red_variation_from_G-1_Gift_set.jpg', '56B-red_variation_from_G-1_Gift_set.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2034, 258, 12, 'MB #57-A Wolseley 1500', 'In 1958 Lesney added another small British car to the range, the #57-A Wolseley 1500.  These models were painted in pale green and rolled on gray plastic wheels.', '', 1264638981, 1, '57A-63.jpg', '57A-63.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2035, 315, 7, 'GL Diorama Steve McQueen Bullitt', 'photo provided by\r\n<a href="http://milezone.com" target=blank>\r\nMileZone</a>', '', 1264640522, 1, 'gldio-01.jpg', 'gldio-01.jpg', '', 1, 0, 0, 1, '10.00', 368),
(2036, 315, 7, 'GL Diorama County Roads', 'photo provided by\r\n<a href="http://milezone.com" target=blank>\r\nMileZone</a>', '', 1264640522, 1, 'gldio-02.jpg', 'gldio-02.jpg', '', 1, 0, 0, 1, '10.00', 298),
(2037, 315, 7, 'GL Diorama Auction Block', 'photo provided by\r\n<a href="http://milezone.com" target=blank>\r\nMileZone</a>', '', 1264640523, 1, 'gldio-03.jpg', 'gldio-03.jpg', '', 1, 0, 0, 0, '0.00', 138),
(2038, 315, 7, 'GL Diorama Hot Pursuit', 'photo provided by\r\n<a href="http://milezone.com" target=blank>\r\nMileZone</a>', '', 1264640523, 1, 'gldio-04.jpg', 'gldio-04.jpg', '', 1, 1, 0, 1, '10.00', 173),
(2039, 258, 12, 'MB #57-B Chevrolet Impala', 'It was February of 1961 when Lesney replaced the 57-A Wolseley 1500 with my personal favorite model from the entire Matchbox regular wheel range, the 57-B Chevrolet Impala.  On the surface it would be easy to look at this assembly of 57-Bs and think I have gone overboard.  The fact that all of the 57-Bs were painted in this two tone blue makes the number of variations mis-leading.  The primary contributor to the variation parade is hidden in this photo.  There are three different wheel colors and four different base colors.  Black and silver plastic wheels are common.  Gray wheels are much harder to find.  (see additional photo with base colors)', '', 1264640608, 1, '57B-114.jpg', '57B-114.jpg', '', 1, 0, 0, 0, '0.00', 49),
(2040, 258, 12, 'MB #57-B Chevrolet Impala- base color variationis', 'One of the fun things about the #57-B Chevrolet Impala is the challenge of finding the assorted four different base colors; left to right: black, dark blue, mid-blue and pale blue.  Dark Blue and Black are the most common.  Light blue seems to be the most elusive.', '', 1264651128, 1, '57B_base_color_variations.jpg', '57B_base_color_variations.jpg', '', 1, 0, 0, 0, '0.00', 36),
(2041, 258, 12, 'MB #57-C Land Rover Fire Truck', 'In January of 1966 Lesney replaced the 57-B Chevrolet Impala with a new Land Rover Fire Truck.  A rare handful of these models roll on gray plastic wheels but the vast majority have black plastic wheels.  The roof light and windows are tinted blue.', '', 1264651128, 1, '57C-180.jpg', '57C-180.jpg', '', 1, 0, 0, 0, '0.00', 35),
(2042, 258, 12, 'MB #58-A AEC British European Airways bus', 'In 1958 Lesney added still another bus to the range with the #58-A AEC bus decked out in the dark blue and labels of the British European Airways.  Wheel colors can be silver, gray or black plastic.', '', 1264651128, 1, '58A-64.jpg', '58A-64.jpg', '', 1, 0, 0, 0, '0.00', 24),
(2043, 258, 12, 'MB #58-B Drott Excavator', 'In October of 1962 Lesney replaced the 58-A British European Airways bus with the 58-B Drott Excavator.  Models were painted red in early years and orange in later.  Early red models had silver engines and bases.  Orange later models were solid orange with no silver trim.  The rollers were mostly black plastic but there was a period during which silver rollers were also pressed into service.', '', 1264651128, 1, '58B-135.jpg', '58B-135.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2044, 258, 12, 'MB #58-C DAF Girder Truck', 'In April of 1968 the Drott Excavator was replaced in the #58 slot by a new DAF Girder truck painted in pale cream and carrying a load of red plastic functional girders', '', 1264651128, 1, '58C-217.jpg', '58C-217.jpg', '', 1, 0, 0, 0, '0.00', 23),
(2045, 258, 12, 'MB #58-C DAF Girder Truck- girders in use', 'Seen here is a demonstration of the genuine play value found within the girder load on the 58-C Girder truck', '', 1264651128, 1, '58C.jpg', '58C.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2046, 258, 12, 'MB #59-A Ford Thames ''Singer'' Van', 'In 1958 Lesney added a wonderful little Thames Van decked out in pale and later darker green with the "Singer'' logo of American sewing machine fame.  Wheels can be gray or silver plastic', '', 1264651128, 1, '59A-65.jpg', '59A-65.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2047, 258, 12, 'MB #59-B Ford Fairlane Fire Chief car', 'In June of 1963 Lesney dusted off the casting that had been used for the #55-B Ford Fairlane Police car and came up with a great new paint scheme to turn that casting into a Fire Chief''s car.  Paint was red, windows were clear, interior and roof dome are white.  The vast majority of these models roll on black plastic wheels but a small number were made on gray plastic.  (see additional photo)', '', 1264651128, 1, '59B-143.jpg', '59B-143.jpg', '', 1, 0, 0, 0, '0.00', 45),
(2048, 258, 12, 'MB #59-B Ford Fairlane Fire Chief car- gray windows', 'Even in rough condition this gray wheeled Fairlane Fire Chief car is a treasure', '', 1264651128, 1, '59B-_gray_plastic_wheels.jpg', '59B-_gray_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 39),
(2049, 258, 12, 'MB #59-C Ford Galaxie Fire Chief car', 'In 1966 the previous Ford Fairlane fire chief''s car was updated with the 59-C Galaxie.  Body was red, windows are clear and the dome lignt is blue.', '', 1264651128, 1, '59C-195.jpg', '59C-195.jpg', '', 1, 0, 0, 0, '0.00', 80),
(2050, 258, 12, 'MB #60-A Morris J2 pickup', 'In 1958 Lesney added a uniquely British Morris J2 Pickup to the range in the #60 slot.  Between decals, wheel colors and casting changes there are at least 15 variations on this casting.', '', 1264651128, 1, '60A-66.jpg', '60A-66.jpg', '', 1, 0, 0, 0, '0.00', 25),
(2051, 258, 12, 'MB #60-B Leyland Site Hut Truck', 'In February of 1966 Lesney replaced the Morris J2 pickup after a long 8 year term within the range.  The new Leyland Site Hut Truck was painted in blue with a plastic yellow and green construction site hut on the bed for transport', '', 1264651128, 1, '60B-184.jpg', '60B-184.jpg', '', 1, 0, 0, 0, '0.00', 25),
(2052, 258, 12, 'MB #61-A Ferret Scout car', 'Early in 1959 Lesney added another military vehicle, the 61-A Ferret Scout car to the range.', '', 1264654035, 1, '61A-79.jpg', '61A-79.jpg', '', 1, 0, 0, 0, '0.00', 38),
(2053, 258, 12, 'MB #61-B ''BP'' Alvis Stalwart', 'In July of 1966 the Ferret Scout car was eliminated from the range and replaced with the unique Alvis Stalwart decked out in white and yellow ''BP'' petroleum colors.  At the tail end the wheels for this model were yellow but the vast majority roll on black tires on green wheels.  There are some casting variations such as the bed beneath the yellow simulated canvas top.  The very first run of these toys have a smooth bed.  All others are ribbed. (see additional photo)', '', 1264654035, 1, '61B-189.jpg', '61B-189.jpg', '', 1, 0, 0, 0, '0.00', 25),
(2054, 258, 12, 'MB #61-B ''BP'' Alvis Stalwart- carrier bed variations', 'smooth and ribbed bed floor variations on the 61-B Alvis Stalwart', '', 1264654035, 1, '61B-_bed_variations.jpg', '61B-_bed_variations.jpg', '', 1, 0, 0, 0, '0.00', 30),
(2055, 258, 12, 'MB #62-A General Service Lorry', 'In 1959 Lesney added another military vehicle, the 62-A General Service Lorry to the range', '', 1264654035, 1, '62A-80.jpg', '62A-80.jpg', '', 1, 0, 0, 0, '0.00', 32),
(2056, 258, 12, 'MB #62-B Commer TV Service Van', 'In June of 1963 the 62-A General Service Lorry was eliminated from the Matchbox range and the 62-B Commer TV service van was added.  The body is painted cream with a red plastic rear overhead lift door.  Each model came equipped with a set of three red plastic TV sets, a roof antena and a ladder.  The final run of these models came decorated with "Radio Rentals" decals in place of the original "Rentaset".  Most of these models roll on black plastic wheels but there are an elusive few on gray.', '', 1264654035, 1, '62B-144.jpg', '62B-144.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2057, 258, 12, 'MB #62-C Mercury Cougar', 'In June of 1968 Lesney replaced the Commer TV repair van with a popular new American car, the Mercury Cougar.  There were a mythical few painted in cream during the first days of this model but the vast majority appeared in metallic lime green.  With red interior and clear windows these were very nice additions to the range.', '', 1264654036, 1, '62C-221.jpg', '62C-221.jpg', '', 1, 0, 0, 0, '0.00', 49),
(2058, 258, 12, 'MB #62-C Mercury Cougar- ''Autosteer'' feature', 'During the late 1960''s Lesney added an ''autosteer'' feature to a number of new entries in the range.  The Cougar was one such recipient.', '', 1264654036, 1, '62C-autosteer.jpg', '62C-autosteer.jpg', '', 1, 0, 0, 0, '0.00', 42),
(2059, 258, 12, 'MB #63-A Ford Service Ambulance', 'In March of 1959 Matchbox continued to round out an impressive selection of military models with the Ford Service Ambulance.', '', 1264654036, 1, '63A-81.jpg', '63A-81.jpg', '', 1, 0, 0, 0, '0.00', 23),
(2060, 258, 12, 'MB #63-B Alvis "Foamite" Airport crash tender', 'In April of 1963 the 63-A Service Ambulance was replaced by an impressive Airport fire-retardant foam spraying truck, commonly found at airports, was added to the range.  The truck appeared in fire engine red With white plastic ladder, hose and side lettering.  Silver foam nozzles are a hard to find premium for this one.', '', 1264654036, 1, '63B-151.jpg', '63B-151.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2061, 258, 12, 'MB #63-C Dodge Crane Truck', 'In September of 1968 the Foamite Crash tender was replaced within the range at the #63 slot by a construction yellow Dodge Crane Truck.  Most models were equipped with a red hook but the final run came out sporting a yellow hook. (see additional photo)', '', 1264654036, 1, '63C-225.jpg', '63C-225.jpg', '', 1, 0, 0, 0, '0.00', 19),
(2062, 258, 12, 'MB #63-C Dodge Crane Truck- yellow hook variatiion', '', '', 1264654036, 1, '63C-_yellow_hook.jpg', '63C-_yellow_hook.jpg', '', 1, 0, 0, 0, '0.00', 26),
(2063, 258, 12, 'MB #64-A Scammell Breakdown Truck', 'In March of 1959 Lesney rolled out a new military tow vehicle in the #64 slot.  There are a number of subtle casting differences on this one as well as assorted varieties and colors of hooks.', '', 1264654036, 1, '64A-82.jpg', '64A-82.jpg', '', 1, 0, 0, 0, '0.00', 36),
(2064, 258, 12, 'MB #64-B MG 1100', 'In 1966 the Scammell Breakdown military tow vehicle was replaced by one of the classic Matchbox entries, the 64-B MG 1100 in green.  The driver and his friendly dog were a popular feature in this rather easy to find model.', '', 1264654036, 1, '64B-182.jpg', '64B-182.jpg', '', 1, 0, 0, 0, '0.00', 30),
(2065, 258, 12, 'MB #65-A 3.4 litre Jaguar sedan', 'Getting away from the miltiary theme, Lesney added the 65-A Jaguar in April of 1959.  Early models were painted in dark blue with the final examples done in a metallic blue.  This model rolled on gray plastic wheels.', '', 1264654036, 1, '65A-83.jpg', '65A-83.jpg', '', 1, 0, 0, 0, '0.00', 34),
(2066, 258, 12, 'MB #65-B 3.4 litre Jaguar sedan', 'In February of 1962 Lesney updated the original 65-A Jaguar with a new red Jaguar sedan.  Early models appeared in metallic red while later examples were coated in a rich non-metallic red.  Wheels could be silver, gray or black on this one.', '', 1264654036, 1, '65B-126.jpg', '65B-126.jpg', '', 1, 0, 0, 0, '0.00', 35),
(2067, 258, 12, 'MB #65-C Claas Combine harvester', 'In August of 1967 Lesney replaced the red 3.4 Litre Jaguar sedan with a more utilitarian red Claas Combine with a yellow grain sweep in the front that would roll as the model was pushed along the floor.', '', 1264654237, 1, '65C-208.jpg', '65C-208.jpg', '', 1, 0, 0, 0, '0.00', 20),
(2068, 258, 12, 'MB #66-A Citroen DS19', 'In April of 1959 Lesney reached out to French collectors with the inclusion of a yellow Citroen DS19 within the range.  These models were equipped with either gray or silver plastic wheels.', '', 1264654237, 1, '66A-84.jpg', '66A-84.jpg', '', 1, 0, 0, 0, '0.00', 34),
(2069, 258, 12, 'MB #66-B Harley Davidson with sidecar', 'In October of 1962 the French Citroen DS19 was replaced within the range by a handsome metallic bronze American Harley Davidson motorcycle and sidecar.  These models were equipped with wonderful realistic wire wheels.', '', 1264722061, 1, '66B-136.jpg', '66B-136.jpg', '', 1, 0, 0, 0, '0.00', 28),
(2070, 258, 12, 'MB #66-C GMC Greyhound Sceniccruiser bus', 'In October of 1966 Lesney replaced the Harley Davidson motorcycle with an impressive Greyhound Sceniccruiser bus.  The buses length was shortened within this scale to allow for the toy to fit a typical Matchbox size package.  All models were painted in silver gray and early models had clear windows.  These models are today highly prized above the more common amber windowed examples', '', 1264722061, 1, '66C-192.jpg', '66C-192.jpg', '', 1, 0, 0, 0, '0.00', 40),
(2071, 258, 12, 'MB #67-A ''Saladin'' Armoured car', 'After a brief change of pace with the 65-A Jaguar and 66-A Citroen Lesney jumped right back into the building of the military presence within the range with the 67-A ''Saladin'' armoured car.', '', 1264722061, 1, '67A-85.jpg', '67A-85.jpg', '', 1, 0, 0, 0, '0.00', 21),
(2072, 258, 12, 'MB #67-B Volkswagen 1600TL fastback', 'In August of 1967 the ''Saladin'' armoured car was replaced with the red Volkswagen 1600TL fastback.  The final brief run of models came out with regular wheels but the metallic purple of the ''Superfast'' range.  These purple models are highly prized.  Some models are found with a plastic roof rack that was present on models that had been purchased through the G-4 Race n Rally gift set.', '', 1264722061, 1, '67B-207.jpg', '67B-207.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2073, 258, 12, 'MB #68-A Austin MK2 Radio Truck', 'Sticking with the military theme Lesney added the 68-A Austin Radio Truck to the range in June of 1959.', '', 1264722061, 1, '68A-86.jpg', '68A-86.jpg', '', 1, 0, 0, 0, '0.00', 20),
(2074, 258, 12, 'MB #68-B Mercedes Coach', 'In September of 1965 the Austin Radio Truck was replaced by a Mercedes cross country coach.  Elusive early models were painted in a turquoise with white plastic tops.  Most models were coated in orange with the same white plastic top.', '', 1264722061, 1, '68B-176.jpg', '68B-176.jpg', '', 1, 0, 0, 0, '0.00', 25),
