(2116, 258, 12, 'MB #69-A Commer 30 ''Nestles'' van', 'In July of 1959 Lesney added looked to the Commer van once again in creating a ''Nestles'' van initially in maroon and later in ligther red.  The side sliding door was a new feature for Lesney.  Wheels were assorted sizes of gray plastic.', '', 1264727860, 1, '69A-87.jpg', '69A-87.jpg', '', 1, 0, 0, 0, '0.00', 30),
(2117, 258, 12, 'MB #69-A Commer 30 ''Nestles'' van- tread variations', 'Within the world of collectors of vintage Matchbox toys it is often the variations that keep us coming back.  Take for instance the 69-A Commer ''Nestles'' van.  All of these models came with gray plastic wheels but the model on the right with finer treads on the tires is much harder to find than the model on the left with coarse treads!  Happy hunting!!', '', 1264727860, 1, '69A_tread_variations.jpg', '69A_tread_variations.jpg', '', 1, 0, 0, 0, '0.00', 35),
(2118, 258, 12, 'MB #69-B Hatra Tractor Shovel', 'In January of 1965 Lesney dropped the Commer ''Nestles'' van from the Matchbox range and added the Hatra Tractor Shovel originally in orange with gray tires.  Over the years there were a number of color and wheel variations on this one.  Orange models with yellow shovels have been reported and are considered highly desireable.', '', 1264727860, 1, '69B-162.jpg', '69B-162.jpg', '', 1, 0, 0, 0, '0.00', 19),
(2119, 258, 12, 'MB #70-A Thames Estate car/van', 'In July of 1959 Lesney added a wonderful little two-tone (turquois and yellow) Thames Estate Car.   Some models had no windows, some had clear, others had green tinted windows.  Wheels could be gray plastic, silver plastic or black plastic.  Between all of these differences there is more than a dozen known variations on this one model', '', 1264727860, 1, '70A-88.jpg', '70A-88.jpg', '', 1, 0, 0, 0, '0.00', 27),
(2120, 258, 12, 'MB #70-A Thames Estate car/van- silver plastic wheels', 'The Thames Estate car (70-A) is hardest to find with silver plastic wheels', '', 1264727860, 1, '70A-_silver_plastic_wheels.jpg', '70A-_silver_plastic_wheels.jpg', '', 1, 0, 0, 0, '0.00', 20),
(2121, 258, 12, 'MB #70-B Ford Grit-spreading truck', 'In 1966 Lesney replaced the Thames Estate car with a Ford Grit-spreading truck with a red cab and pale yellow grit container.  Beneath the grit container is either a gray or black plastic pull that actually allows gritty salt or sand to fall from the bottom.  Later models had a brighter yellow grit container (see additional photo)', '', 1264727860, 1, '70B-177.jpg', '70B-177.jpg', '', 1, 0, 0, 0, '0.00', 19),
(2122, 258, 12, 'MB #70-B Ford Grit-spreading truck- bright yellow container', 'The final run of the 70-B Ford Grit truck had the grit container painted in a brigher yellow.  These models are hard to find.', '', 1264727860, 1, '70B-_bright_yellow_bed.jpg', '70B-_bright_yellow_bed.jpg', '', 1, 0, 0, 0, '0.00', 22),
(2123, 258, 12, 'MB #71-A Austin 200 gallon water truck', 'In September of 1959 Lesney added an Austin water truck to the military collection within their fleet.  The very first Matchbox collector''s badge was released with sales of this model.', '', 1264727860, 1, '71A-89.jpg', '71A-89.jpg', '', 1, 0, 0, 0, '0.00', 18),
(2124, 258, 12, 'MB #71-B Jeep Gladiator', 'In January of 1964 Lesney looked to America once again with the release of this red 71-B Jeep Gladiator.  A few of the earliest models had green plastic interior.  Those are pretty tough to find in any condition.  Most models featured a white plastic interior', '', 1264727860, 1, '71B-148.jpg', '71B-148.jpg', '', 1, 0, 0, 0, '0.00', 36),
(2125, 258, 12, 'MB #71-C Ford Heavy Wreck Truck', 'On October of 1968 Lesney replaced the Jeep Gladiator with this impressive Ford Heavy Wreck Truck.  With the red body and white crane bed the model worked well with its ''Esso'' labeling.  Early models had amber colored windows and those are very hard to find today.   Most models rolled out of the factory with green windows.  Hooks could be red or yellow', '', 1264727860, 1, '71C-226.jpg', '71C-226.jpg', '', 1, 0, 0, 0, '0.00', 18),
(2126, 258, 12, 'MB #72-A Fordson Major Tractor', 'In October of 1959 Lesney added a new tractor to the range, the Fordson Major in traditional Ford tractor blue.  These models came with either gray or black plastic wheels.  Some models had solid plastic front wheels.  Later models had plastic wheels of orange on the front as well as back wheels.', '', 1264727860, 1, '72A-90.jpg', '72A-90.jpg', '', 1, 0, 0, 0, '0.00', 24),
(2127, 258, 12, 'MB #72-B Jeep CJ5', 'In October of 1966 Lesney added a new Jeep, a wonderful little yellow CJ5 to the range in the 72-B slot replacing the Fordson Major tractor.  A couple of mythical models with white plastic interior have been reported but these models hit the market with red interiors', '', 1264727860, 1, '72B-193.jpg', '72B-193.jpg', '', 1, 0, 0, 0, '0.00', 15),
(2128, 258, 12, 'MB #73-A 10 ton Pressure Refueler', 'In October of 1959 Lesney added another military vehicle to the range, the 73-A 1- ton Pressure Refueler.  Unlike most of the military vehicles which were painted in military olive green, this model appeared in the blue of the British Royal Air Force.  Most of these models rolled on gray plastic wheels.  A handful a the tail end of the run appeared with black plastic wheels.', '', 1264727860, 1, '73A-91.jpg', '73A-91.jpg', '', 1, 0, 0, 0, '0.00', 28),
(2129, 258, 12, 'MB #73-B Ferrari Formula 1 racer', 'In November of 1962 Lesney added a beautiful Ferrari Formula 1 racer in what else.... Ferrari RED!  Models were accented with the Ferrari prancing stallion decal and detailed wire wheels.  Plastic drivers could be white or gray plastic', '', 1264727860, 1, '73B-137.jpg', '73B-137.jpg', '', 1, 0, 0, 0, '0.00', 23),
