(2188, 258, 12, 'MB #73- C Mercury Commuter Station Wagon', 'In October of 1968 Lesney replaced the flashy 73-B Ferrari racer with a humble family vehicle, the Mercury Station Wagon.  These models were painted in metallic lime green with clear windows and cream interior.  One of this model''s highlights is the pair of dogs with their heads out the rear window (see additional photo)', '', 1264733785, 1, '73C-227.jpg', '73C-227.jpg', '', 1, 0, 0, 0, '0.00', 33),
(2189, 258, 12, 'MB #73- C Mercury Commuter Station Wagon- dogs!', 'In the late 1960''s Lesney tried hard to add small details for special interest with models.  The 73-C Mercury wagon featured a pair of dogs peeking out the rear window', '', 1264733785, 1, '73C-dogs.jpg', '73C-dogs.jpg', '', 1, 0, 0, 0, '0.00', 18),
(2190, 258, 12, 'MB #74-A Mobile Refreshment Canteen- fleet', 'From the top side most of the 74-A Refreshment canteen fleet looks pretty much the same other than the very hard to find cream colored example.  Turn them over and we find a rainbow of base and wheel color variations (see additional photos)', '', 1264733786, 1, '74A_fleet.jpg', '74A_fleet.jpg', '', 1, 0, 0, 0, '0.00', 23),
(2191, 258, 12, 'MB #74-A Mobile Refreshment Canteen', 'In November of 1959 Lesney added a very nice Refreshment Canteen trailer to the Matchbox range.  Early models appeared in short runs of either white, cream or pinkish cream body paint.  These early models are quite elusive.  The vast majority of these models over the seven years it appeared within the range appeared in silver body paint.  Because of casting changes, body color differences, wheel color and tread differences and FIVE different base colors this one model has become a sub-collectoin within many Matchbox fans larger collection.  There are at least 20 possilble variations on this one model.  (see additional photos)', '', 1264733786, 1, '74A-92.jpg', '74A-92.jpg', '', 1, 0, 0, 0, '0.00', 23),
(2192, 258, 12, 'MB #74-A Mobile Refreshment Canteen- base colors', 'A personal obsession for me as a Matchbox collector became the assorted five base colors of the 74-A Refreshment Canteen.  From top to bottom the colors are: pale blue, light blue, sea green, mid-blue and dark blue.  The second model from the top is most common.  Hardest to find would be sea green or mid blue.', '', 1264733786, 1, '74-A_base_colors.jpg', '74-A_base_colors.jpg', '', 1, 0, 0, 0, '0.00', 15),
(2193, 258, 12, 'MB #74-B Daimler Fleetline bus', 'In April of 1966 Lesney added still another double decker bus to the range, the 74-A Daimler Fleetline.  Early models appeared in cream, later in green and finally in red.  Seen here is a red model with box still within it''s original bubble pack packaging.  Many collectors are delighted to find such unblemished original packaging.', '', 1264733786, 1, '74B-186.jpg', '74B-186.jpg', '', 1, 0, 0, 0, '0.00', 16),
(2194, 258, 12, 'MB #75-A Ford Thunderbird', 'In May of 1960 Lesney added another of my absolute favorite models to the range, the #75-A Ford Thunderbird.  From the top all of these models look alike with their two-tone cream and salmon body paint.  It is from beneath that this model''s many differences show.  Most models came with silver plastic wheels but some came with gray plastic and even less with black plastic wheels.  This is another one of the models with a wonderful rainbow of four different base color variations. (see additional photos)', '', 1264733786, 1, '75A-93.jpg', '75A-93.jpg', '', 1, 0, 0, 0, '0.00', 33),
(2195, 258, 12, 'MB #75-A Ford Thunderbird- base color variations', 'One of the wonderful features for collectors of the 75-A Ford Thunderbird are the four assorted base colors.  Top to bottom we have: black, dark blue, blue-green and blue', '', 1264733786, 1, '75A-_base_colors.jpg', '75A-_base_colors.jpg', '', 1, 0, 0, 0, '0.00', 16),
(2196, 258, 12, 'MB #75-B Ferrari Berlinetta', 'Many people have the misconception that because the Ferrari Berlinetta has the 75-B designation that it was the last of the models introduced within Lesney''s Matchbox regular wheel era.  In actuality the 75-B Berlinetta replaced the 74-A Ford Thunderbird in May of 1965, more than four years before the final model in the range, the 42-C Iron Fairy Crane.\nThe Berlinetta appeared first with a metallic green body and wonderful wire wheels.  Later models switched to a more simple silver plate wheel.  The genuine prize with this one would be one of the final run red models with silver disk wheels.', '', 1264733786, 1, '75B-167.jpg', '75B-167.jpg', '', 1, 0, 0, 0, '0.00', 25),
