(2245, 290, 12, 'Matchbox #56-B Fiat 1500 custom ''Cairo'' taxi', 'My family visited Egypt during the summer of 2008 and I found that old Fiats like the 56-B from the Matchbox line are still used today on the crazy streets of Cairo as ''black & white'' taxi cabs.\nWhen we came home I commissioned Diecast Hall of Famer Sheri Abbey to create a Cairo Cab from an old 56-B beater.  Love it!  Thanks Sheri!', '', 1264826723, 1, 'taxi_front.jpg', 'taxi_front.jpg', '', 1, 2, 0, 0, '0.00', 154),
(2246, 290, 12, 'Matchbox ''65 Austin Mini Van custom', 'Matchbox released the Austin Mini van casting in 2008.  Diecast Hall of Famer Sheri Abbey created a custom run of 55 like this one for me to promote my dental office and to share with diecast collecting friends.', '', 1264826723, 1, 'minin_front.jpg', 'minin_front.jpg', '', 1, 0, 0, 0, '0.00', 113),
(2247, 290, 12, 'Matchbox MB-38 Model A Ford van- Code 2', 'The folks at Color Comp did a run of models on the Matchbox MB-38 Model A Ford casting to promote my dental office and to share with diecast friends.', '', 1264826723, 1, 'Matchbox_MB38_for_office.jpg', 'Matchbox_MB38_for_office.jpg', '', 1, 0, 0, 0, '0.00', 133),
(2248, 258, 12, 'MB Accesory Pack- A2 Bedford Car Transporter', 'In 1956 the people at Lesney introduced a line of Accesory pieces that were meant to enhance parallel play with toys from the Matchbox 1-75 regular wheel toy range.  The most successful of these Accesory Pack toys was the A2 Bedford Car Transporter introduced in 1957 and produced until 1962.  All of the transporter variations were painted in light blue except for the hard to find final run from 1962 that was painted with a red cab and gray trailer.  Here the transporters are loaded down with a lovely load of 57-B Chevrolet Impalas from the Matchbox regular wheel range.', '', 1264826723, 1, 'car_haulers.jpg', 'car_haulers.jpg', '', 1, 0, 0, 0, '0.00', 44),
(2249, 258, 12, 'MB Accessory Pack- A3 Garage', 'In 1956 the people at Lesney introduced a line of Accesory pieces that were meant to enhance parallel play with toys from the Matchbox 1-75 regular wheel toy range. \nThe A3 garage was released in 1958 and offered housing for Matchbox toys like the 57-B Chevrolet Impala', '', 1264826723, 1, 'car_garage.jpg', 'car_garage.jpg', '', 1, 0, 0, 0, '0.00', 34),
(2250, 258, 12, 'MB Accessory Pack- A5 Home Store', 'In 1956 the people at Lesney introduced a line of Accesory pieces that were meant to enhance parallel play with toys from the Matchbox 1-75 regular wheel toy range. \nIn 1961 the A5 Home Store was introduced as a site from which Matchbox players might acquire their groceries!', '', 1264826723, 1, 'store_miilk.jpg', 'store_miilk.jpg', '', 1, 0, 0, 0, '0.00', 32),
(2251, 258, 12, 'MB Major Pack- M1-1 Caterpillar Earthmover scraper', 'In 1957 Lesney pioneer Jack Odell''s ''Major Pack'' line was added to the typical 1-75 Matchbox range.  The Major Pack vehicles retained the approximate 1:64 scale and were intended to enhance the 1-75 line by depicting types of vehicles that were too long for the typical box size restraints.  Major Pack models numbers began with the letter ''M''.  The very first release in the Major Pack line, #M-1, was a construction vehicle, the Caterpillar DW20 Earth Scraper.', '', 1264826723, 1, 'mp_scrap.jpg', 'mp_scrap.jpg', '', 1, 0, 0, 0, '0.00', 29),
(2252, 258, 12, 'MB Major Pack- M1-2 B.P. Autotanker', 'In 1957 Lesney pioneer Jack Odell''s ''Major Pack'' range was added to the Matchbox line to enhance the offerings of the 1-75 range.  Major Pack''s were the same 1:64 scale but allowed for recreation of vehicles too long to fit into the traditional Matchbox sized boxes.  \nHere is the #M-1B futuristic BP Petrol Tanker.  The toy was modeled from a prototype vehicle of which only one real vehicle was ever built.', '', 1264826723, 1, '007.jpg', '007.jpg', '', 1, 0, 0, 0, '0.00', 37),
(2253, 258, 12, 'MB Major Pack- M10-1 Whitlock Dinkum Dumper', 'In 1957 Lesney pioneer Jack Odell''s ''Major Pack'' range was added to the Matchbox line to enhance the offerings of the 1-75 range.  Major Pack''s were the same 1:64 scale but allowed for recreation of vehicles too long to fit into the traditional Matchbox sized boxes.  \nHere is the M-10 Dinkum Dumper with silver metal wheels.  This model was released in 1962', '', 1264826723, 1, 'mp_dink.jpg', 'mp_dink.jpg', '', 1, 0, 0, 0, '0.00', 30),
(2254, 258, 12, 'MB Major Pack- M10-1 Whitlock Dinkum Dumper', 'In 1957 Lesney pioneer Jack Odell''s ''Major Pack'' range was added to the Matchbox line to enhance the offerings of the 1-75 range.  Major Pack''s were the same 1:64 scale but allowed for recreation of vehicles too long to fit into the traditional Matchbox sized boxes.  \nHere is the M-10 Dinkum Dumper with red plastic wheels.', '', 1264826723, 1, 'mp_dink_red.jpg', 'mp_dink_red.jpg', '', 1, 0, 0, 0, '0.00', 32),
