(3528, 26, 272, 'JL Mopar or no car R8 ''62 Plymouth Belvedere - Blue', 'Released in 2005\n\nIn real life at first the 361 was going to be the biggest motor. But Chrysler made the desicion to go all out later on. A few 413 single 4BBL''s were sold.  it was the standard mild cammed torque motor from the Chrysler line. \n Also for a short time the 413 inline Dual 4BBL motor from the Chrysler 300 line was available. less that 100 were made for Plymouth and Dodge combined.\nBut then they Brought out The 413 Max Wedge.  Now Mopar was strong in Super Stock racing.  The max wedge engine with the push button 727 Automatic tranny was Tuff to beat on the strip or street.  The 62 thru 64 B bodies Put Mopar on the map when it came to super stock and hot street racing. Before 1962 Chrysler didn''t care about 1/4 mile drag racing.  Then they woke up and went all out. The Top brass said do whatever it takes to take control of the street the strip and nascar.  The results were the 413/426 max wedge, then the 426 hemi and 426 Sport(street) wedge engines. 426 Hemi dual  cam (4 Valves per pistion) engines were being designed if needed (they never made them).', '413 maxwedge max wedge fury 62 Plymouth', 1266554404, 1, '035.jpg', '035.jpg', '', 1, 0, 0, 0, '0.00', 129),
