(3531, 26, 272, 'JL Mopar or no Car ''62 Plymouth Group of 3', 'From The Left to right.\n\n62 Plymouth Belvedere yellow,  from a Mopar or no car box set 1, unsure of the year but late 2004 or 2005\n\n62 Plymouth Savoy Blue, From Mopar or No car box Set.  late 2004 or 2005 also (not the same set as the Yellow one )  The lettering on the side is "Plymouth of Troy"\n and "if you can read this, Turn me over!".\nOn the roof it has "Gray-headed Art"\n\n62 Plymouth Sport Fury Red,  This one is a white lightning with White rims and slightly shaded windows.  It''s from mopar or no car R7 , late 2005. This one is found on card.\n\nNote there is a difference in the Savoy, Belvedere, Fury and Sport Fury in the JL''s.   They have different taillights, trim, emblems and maybe other things.', '', 1266623801, 1, '054.jpg', '054.jpg', '', 1, 0, 0, 0, '0.00', 98),
