(3925, 348, 272, 'KeeKee Kitty', 'sounds like "KeyKey Kitty" .  here she is helping out with cleaning. she likes activity. she has very silky soft fur. (she loves to be told that too)\nWe got her from a shelter about 4 years ago. It was tuff going at first. she was abused and abondoned before. Two other people tried her out before us and brought her back to the shelter. She just seemed happier at the shelter.  But we gave her a try. she was very shy at first, she stayed in the basement for a month. ran for cover on sight.  But she came around. KeeKee is not shy anymore. she is very sweet and affectiant. Very freindly to strangers (people or visting kitties).  But I still can''t pick here up thou. we have another cat too,  pics will come later.', '', 1270177515, 1, 'KeeKee.jpg', 'KeeKee.jpg', '', 1, 0, 0, 0, '0.00', 82),
